INSERT INTO `blogs` (`blog_id`, `blog_title`, `blog_description`, `blog_title_display_name`, `blog_slug`, `category_id`, `sub_category_id`, `language_id`, `images`, `status`, `created_at`, `updated_at`) VALUES
(1, 'knowing-the-benefits-of-turmeric-on-skin', '<p><span style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: medium; letter-spacing: normal; white-space: pre;\">Want to get healthy and glowing skin? Turmeric contains the antioxidants</span></p>', 'Knowing the Benefits of Turmeric on Skin', NULL, 1, NULL, 1, 'blog1.JPG', '1', '2020-12-17 07:34:00', '2021-06-18 00:44:20'),
(2, 'asheagandha-benefits', '<p>There is no surprising factor that whenever we talk about the inception of natural remedies, we find the herbs like Ashwagandha has been serving humankind with assured results for thousands of years. It is one of the best ayurvedic herbs (*adaptogen) that have been used to increase vitality in humans for over 3000 years. Believe it or not, it is a very close relative of eggplant (Aubergine) and peppers.\\r\\n\\r\\nWhat is Adaptogen?\\r\\nIt is especially a plant extract and nontoxic substance that is used to increase the immunity power to reduce the damaging impacts of depression, stress and restore the physiological functioning to normal. In ancient days, it was used as one of the best herbs to rejuvenate the body, power booster and vitality enhancer.\\r\\n\\r\\nAshwagandha has the power to provide great resistance to your body in order to fight against diseases like fever, cancer, nausea, diabetes, Cancer, leukoderma, rheumatism, bronchitis, asthma, arthritis and inflammation issues. It also improves co<br></p>', 'TOP 4 WAYS THAT ASHWAGANDHA CAN IMPROVE YOUR VITALITY AND HEALTH', NULL, 1, NULL, 1, 'ashwagandha.jpg', '1', '2020-12-17 07:36:40', '2021-01-15 18:25:41'),
(3, 'best-rice-in-the-market', '<p><b style=\"\">Very Good Quality And&nbsp; Taste Of the Rice</b></p><p><b style=\"\">Benefits Of The Rice</b></p><ol><li><b style=\"\">Improve Immunity</b></li><li><b style=\"\">Increase Texture Of the Skin</b></li><li><b style=\"\">Very Good For Health</b></li></ol><p><b style=\"\"><br></b></p>', 'Best Rice In The Market', NULL, 1, NULL, 1, 'IMG_20201218095829SYRUP.JPG', '0', '2020-12-18 01:40:44', '2021-04-05 22:09:10'),
(4, 'किसी आलेख का', '<p><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif; letter-spacing: normal;\">किसी आलेख का वह खंड जिसमें कोई एक बात कही गई हो तथा जिसकी पहली पंक्ति कुछ स्थान छोड़ कर लिखी गई हो; परिच्छेद; अनुच्छेद; (पैरा)।</span><br></p>', 'किसी आलेख का वह खंड जिसमें कोई', NULL, NULL, NULL, 2, 'IMG_20210224062127HIMALYAN_FACE_CREME_1.JPG', '1', '2021-02-24 13:21:27', '2021-02-26 13:53:39'),
(5, 'پیرا گراف ، عبارت کا ایک ممتاز حصّہ ، ٹکڑوں میں تقسیم کرنا ، پیراگراف بنانا ،', '<p>پیرا گراف ، عبارت کا ایک ممتاز حصّہ ، ٹکڑوں میں تقسیم کرنا ، پیراگراف بنانا ،<br></p>', 'پیرا گراف ، عبارت کا ایک ممتاز حصّہ ، ٹکڑوں میں تقسیم کرنا ، پیراگراف بنانا ،', NULL, NULL, NULL, 3, 'IMG_20210224062500HYDRANGEAS.JPG', '1', '2021-02-24 13:25:00', '2021-02-26 13:53:54'),
(6, 'green-tea-&amp;-the-next-gen-consumers-go-hand-in-glove', '<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"mso-bidi-font-size:12.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">In the past\r\ndecade or so, Green tea has slowly become popular all over the globe owing to\r\nits numerous health benefits and great taste. <b style=\"mso-bidi-font-weight:\r\nnormal\">Green tea</b> is native to China and India and is made out of the\r\nleaves of the Camellia sinensis plant. The tea is churned out from un-oxidized\r\nleaves, which are steamed and pan-fried, followed by drying. It is one of the\r\nleast processed types of tea, leading to a high content of antioxidants and\r\nbeneficial polyphenols that help in reducing inflammation. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"mso-bidi-font-size:12.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">Due to recent <b style=\"mso-bidi-font-weight:normal\">health awareness</b> among people, the consumption\r\nof green tea undoubtedly has increased. Since the time green tea became famous\r\nand people started replacing their traditional tea with it for <b style=\"mso-bidi-font-weight:normal\">fitness</b> and <b style=\"mso-bidi-font-weight:\r\nnormal\">wellness</b> purposes, many different flavours have been introduced of\r\nthis variant in the market. Green tea is also used in the preparation of\r\ntraditional Indian and Chinese medicine since ancient times. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"mso-bidi-font-size:12.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">The numerous\r\nhealth benefits of Green tea are as follows- </span></p>\r\n\r\n<b>Cancer prevention:</b>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"mso-bidi-font-size:12.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">There\r\nis decrease in tumour growth in the laboratory as well as animal studies and the\r\ntea might as well protect against damage caused by ultraviolet UVB radiation\r\ndue to the polyphenols present in it. Trends of higher green tea consumption and\r\nlower cancer rates are observed in some countries. </span></p>\r\n\r\n<b>Beneficial to heart:</b>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"mso-bidi-font-size:12.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">Green\r\ntea consumption has been associated with reduced mortality due to all causes,\r\nincluding cardiovascular disease. According to a study, drinking tea three or\r\nmore times per week shows improved cardiovascular health. However, the benefits\r\nare more noticeable and striking among drinkers of green tea and in the case of\r\nmen rather than women. </span></p>\r\n\r\n<b>Weight loss:</b>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"mso-bidi-font-size:12.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">It is well-known and one of the reasons for its popularity\r\nthat green tea promotes a small amount of weight loss in obese or overweight\r\nadults. Many people also believe in the <b style=\"mso-bidi-font-weight:normal\"><i style=\"mso-bidi-font-style:normal\">detox </i></b>ability of this tea as it acts\r\nas a natural flush to the body’s system.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"mso-bidi-font-size:12.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">An <b style=\"mso-bidi-font-weight:normal\">immunity boost</b> is achieved when the\r\nantioxidant-rich green tea is consumed. Especially during the <b style=\"mso-bidi-font-weight:normal\">pandemic</b> wherein people are taking\r\nextra good care of their health, green tea has become a convenient option. In\r\nthis <b style=\"mso-bidi-font-weight:normal\">new normal</b> post-Covid era, the consumption\r\nof green tea is advantageous and highly recommended. </span></p>', 'Green Tea & The Next Gen Consumers Go Hand In Glove', NULL, NULL, NULL, 1, 'IMG_20210324123329GREEN TEA IMAGE FOR CURE ROOT BLOG-MIN.JPG', '1', '2021-03-24 19:33:29', '2021-03-24 19:42:40');
INSERT INTO `blogs` (`blog_id`, `blog_title`, `blog_description`, `blog_title_display_name`, `blog_slug`, `category_id`, `sub_category_id`, `language_id`, `images`, `status`, `created_at`, `updated_at`) VALUES
(7, 'significance-of-ayurveda-in-enhancing-immunity-in-the-modern-age', '<p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:Cambria;\r\nmso-bidi-font-family:Cambria\" lang=\"EN-US\">With the pandemic scarred global community trying\r\nto get back to normal, the world turns its attention to building up <b style=\"mso-bidi-font-weight:normal\">immunity</b>. The Corona Virus has\r\nchallenged the health care systems all across the globe. Virology\r\ninvestigations by scientists and researchers have emphasized the need to build\r\nup the body’s defence forces against disease-causing germs. Building up <b style=\"mso-bidi-font-weight:normal\">immunity </b>in the human body has come up\r\nas a fundamental requirement for all of us alike till potential vaccination\r\nmakes us secure.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:Cambria;\r\nmso-bidi-font-family:Cambria\" lang=\"EN-US\">The need of the hour is the harnessing of all\r\npotential medicinal knowledge systems. This brings to the forefront a pragmatic\r\nplan based on classic Ayurveda for medical intervention. The medical community\r\nhas hailed Ayurvedic remedies to prevent and treat COVID-19 due to their <b style=\"mso-bidi-font-weight:normal\">immunity</b>-boosting properties.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:Cambria;\r\nmso-bidi-font-family:Cambria\" lang=\"EN-US\">This has led to an upsurge in the usage of\r\nmedicinal herbs like Tulsi, Giloy, and Turmeric. People have started including\r\nthese in their daily consumption cycle. Tulsi has miraculous properties to\r\ntreat infections, coughs, and colds and contains powerful anti-microbial agents\r\nthat can heal respiratory tract infections. Tulsi tea is a time-tested drink.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:Cambria;\r\nmso-bidi-font-family:Cambria\" lang=\"EN-US\">Turmeric, which is a common Indian kitchen\r\ncondiment, is a superfood packed with anti-inflammatory and antioxidant properties.\r\nTurmeric milk in the form of golden latte is fast becoming a best seller and is\r\navailable in hospital canteens in some cities.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:Cambria;\r\nmso-bidi-font-family:Cambria\" lang=\"EN-US\">Similarly, Giloy, another incredible Ayurvedic\r\nherb, has been found to be very beneficial in improving your <b style=\"mso-bidi-font-weight:normal\">immunity</b> to fight the Corona infection.\r\nIts antioxidant properties can ease fever. Giloy kadha has come up as a\r\nsignature <b style=\"mso-bidi-font-weight:normal\">immunity</b> booster drink.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><a name=\"_heading=h.gjdgxs\"></a><span style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">The post-pandemic\r\nsociety has seen a demand surge for <b style=\"mso-bidi-font-weight:normal\">immunity</b>-boosting\r\nproducts. Companies are re-branding their products on Ayurvedic lines. Ayurveda\r\nhas extended the medicinal boundaries beyond traditional chemical drugs to a\r\nhigher awareness&nbsp;of the body’s natural needs.</span></p>\r\n\r\n<p><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n  </w:Compatibility>\r\n  <w:DoNotOptimizeForBrowser/>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"&#45;-\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapIndent m:val=\"1440\"/>\r\n   <m:intLim m:val=\"subSup\"/>\r\n   <m:naryLim m:val=\"undOvr\"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState=\"false\" DefUnhideWhenUsed=\"false\"\r\n  DefSemiHidden=\"false\" DefQFormat=\"false\" DefPriority=\"99\"\r\n  LatentStyleCount=\"376\">\r\n  <w:LsdException Locked=\"false\" Priority=\"0\" QFormat=\"true\" Name=\"Normal\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" QFormat=\"true\" Name=\"heading 1\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" SemiHidden=\"true\"\r\n   UnhideWhenUsed=\"true\" QFormat=\"true\" Name=\"heading 2\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" SemiHidden=\"true\"\r\n   UnhideWhenUsed=\"true\" QFormat=\"true\" Name=\"heading 3\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" SemiHidden=\"true\"\r\n   UnhideWhenUsed=\"true\" QFormat=\"true\" Name=\"heading 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" SemiHidden=\"true\"\r\n   Unhide