INSERT INTO `blogs` (`blog_id`, `blog_title`, `blog_description`, `blog_title_display_name`, `blog_slug`, `category_id`, `sub_category_id`, `language_id`, `images`, `status`, `created_at`, `updated_at`) VALUES
(8, 'moringa- an-established-superfood', '<p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:Cambria;\r\nmso-bidi-font-family:Cambria\" lang=\"EN-US\">The COVID-19 <b style=\"mso-bidi-font-weight:normal\">pandemic</b>\r\nhas challenged the current medicinal system with considerable mortality\r\nworldwide. It has brought to the forefront the significance of alternative\r\nsystems of medicine and herbal therapy for general <b style=\"mso-bidi-font-weight:\r\nnormal\">wellness </b>and health. Widespread usage of natural <b style=\"mso-bidi-font-weight:normal\">immunity</b> boosters has been in the wake\r\nglobally. People have started including medicinal herbs like Basil, Giloy, Green\r\nTea, Licorice and Moringa in their daily consumption pattern. They are in sync\r\nwith nature and have zero side effects. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:Cambria;\r\nmso-bidi-font-family:Cambria\" lang=\"EN-US\">Undoubtedly, Moringa Oleifera has been recognized\r\nfor its miraculous <span style=\"color:#333333;background:white;mso-highlight:\r\nwhite\">pharmacological properties. </span>Commonly known as the drumstick tree\r\nin India, this medicinal food is laden with nutrients and is rich in\r\nantioxidants. You can take the natural route to an <b style=\"mso-bidi-font-weight:\r\nnormal\">immunity</b> boost with this power-packed superfood.</span><span style=\"font-family:&quot;Cambria&quot;,serif;background:white;mso-highlight:\r\nwhite\" lang=\"EN-US\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp; </span></span><span style=\"font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:Cambria;mso-bidi-font-family:\r\nCambria\" lang=\"EN-US\">It is touted for its antibiotic and antibacterial properties that help\r\ninhibit the growth of various pathogens.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:Cambria;\r\nmso-bidi-font-family:Cambria\" lang=\"EN-US\">Scientific journals worldwide have highlighted\r\nits medicinal and nutritional properties that can be put to multifarious <b style=\"mso-bidi-font-weight:normal\">immunity</b>-boosting and <b style=\"mso-bidi-font-weight:normal\">wellness</b> uses.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><i style=\"mso-bidi-font-style:normal\"><span style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">Food Science and\r\nHuman Wellness</span></i><span style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"> journal had a\r\nstudy published in 2016 on Moringa’s nutritional </span><span style=\"font-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\"></span><span style=\"font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:Cambria;\r\nmso-bidi-font-family:Cambria\" lang=\"EN-US\">value.<span style=\"mso-spacerun:yes\">&nbsp; </span>It\r\nmentions that this miracle food is 7 times more efficient than oranges for\r\nVitamin C, 15 times more powerful than bananas for potassium, has 10 times more\r\nVitamin A than carrots, 17 times more calcium than milk, and has 25 times more\r\niron than that in spinach.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><i style=\"mso-bidi-font-style:normal\"><span style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">Frontiers in\r\nPharmacology journal</span></i><span style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"> had published an\r\narticle way back in 2012, citing the successful use of Moringa in traditional\r\nIndian medicine and emphasized the need to use this product for holistic <b style=\"mso-bidi-font-weight:normal\">wellness </b>in modern medicine.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><i style=\"mso-bidi-font-style:normal\"><span style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">Robin Foroutan,\r\nMS RDN, a nutritionist and a spokesperson for the Academy of Nutrition and\r\nDietetics</span></i><span style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"> in New York\r\nCity, has also emphasized the significance of the Moringa powder as a robust\r\nantioxidant.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><a name=\"_heading=h.gjdgxs\"></a><span style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:Cambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\">According to WHO\r\nreports, by 2050, the world’s population of senior citizens is expected to\r\nincrease to 2 billion. The rising awareness of organic health products and the\r\nmedical advantages of Moringa are expected to drive the market over the\r\nforecast period. This has triggered the demand for exotic plants like Moringa\r\nin various countries worldwide.</span></p>\r\n\r\n<p><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  