(302, '2019050000200', 'شنطة كتف رجاليه ذات تصميم أسود أنيق', 'شنطة كتف رجاليه ذات تصميم أسود أنيق', '11', '16', '5', 'الحجم: الطول 19*العرض 5*الارتفاع 23سم', NULL, 'اسود', 'البولي يوريثين', 'Yes', 89.00, 229.00, '7510-04/019', '<div>شنطة كتف رجاليه ذات تصميم أسود أنيق</div><div>الوصف:</div><div>شنطة كتف رجالية بأسلوب عصري أنيق, تتفرد بتصميم فائق الجمال لتمنح الشباب إطلالة مميزة تواكب الموضة, تفاصيلها تُظهر الدقة العالية بالتصميم فهي تأخذ قالب منظم وواسع من الجلد الأسود المتين, كما أنها تتميز بالكثير من المواصفات التي تجعلها الاختيار الأمثل في كل الأوقات لكل شب أنيق, هذه الشنطة الرائعة من صنع العالمية (أيقونة الجودة والتصاميم العصرية للشنط الرجالية).</div><div><br></div><div>مميزات شنطة كتف رجاليه ذات تصميم أسود أنيق:</div><div>• شنطة رجاليه بتصميم من الطراز الفاخر ذو طابع عصري باللون الأسود.</div><div>• تتميز الشنطة بوجود جيوب خارجية (جيب أمامي, جيب خلفي), غلاف جلد متين.</div><div>• حزام كتف قابل للتعديل.</div><div>• سحاب الحقيبة من أجود أنواع السحابات المتينة محكمة الإغلاق.</div><div>• شنطة رجاليه خفيفة الوزن.</div><div>• شنط الرجالية من&nbsp; مصنوعة من أجود الخامات المقاومة للتآكل والتلف.</div><div>• مناسبة جداً لحفظ البطاقات المصرفية وبطاقات العمل والأوراق النقدية.</div><div>• حجم مثالي ومميز لكل شاب أنيق يعشق الإطلالات الرفيعة.</div><div>• بطانة داخلية فاخرة مقاومة للتآكل</div><div><br></div><div>تفاصيل شنطة كتف رجاليه:</div><div>العلامة التجارية للشنطة : للشنط رجاليه.</div><div>اللون : لون أسود.</div><div>الطراز :&nbsp; 21102.</div><div>الخامات : البولي يوريثين.</div><div>كود المنتج : 2019050000200.</div><div>الأبعاد : L19*W5*H23cm</div><div>SKU : 7510-04/019</div>', 'شنطة كتف رجاليه ذات تصميم أسود أنيق ، شنطة رجالية صغيرة تجمع بين جمال التصميم ودقة التنفيذ لتمنح مظهر عصري ، من أجمل منتجات متجر ساغا للحقائب', '61.14', '0', NULL, '2', 'mvcode_image_302_128019522.jpg', 'mvcode_image_302_0_2088074287.jpg|mvcode_image_302_1_10624422.jpg|mvcode_image_302_2_1035002245.jpg|mvcode_image_302_3_2128226828.jpg', NULL, 49, '1', '2022-01-14 22:56:14', '2022-01-14 22:56:14'