(308, '2018000000618', 'شنطة ظهر لون أسود', 'شنطة ظهر لون أسود', '13', '18', '5', 'الحجم: الطول 19*العرض 5*الارتفاع 23سم', NULL, 'اسود', 'نايلون', 'Yes', 119.00, 289.00, 'LSB8797-05/018', '<div>شنطة شنطة ظهرلون أسود&nbsp;</div><div><br></div><div>الوصف:&nbsp;</div><div>شنطة ظهر فاخرة بتصميم شبابي راقي، واسعة تتسع لحمل الكمبيوتر المحمول والمستلزمات الشخصية، متعددة الاستخدامات تتميز بحجمها المثالي والمميز وتقسيمتها الداخلية المتعددة والمبطنة ببطانة مقاومة لتآكل، حمالات كتفين مريحة قابلة لتعديل ، وحشوة الظهر طبية تسمح بتهوية الظهر، مصنوعة من النايلون عالي الجودة والذي يتميز بالمتانة وخفة الوزن، حقيبة الظهر من&nbsp; مناسبة لجميع المشاوير العملية.</div><div><br></div><div>مميزات شنطة ظهرلون أسود :</div><div>• التصميم الأنيق والجيوب المتعددة.</div><div>• مصنوعة من مادة النايلون عالي الجودة.</div><div>• حمالات كتفين مريحة قابلة لتعديل.</div><div>• سحاب الحقيبة مزدوج من أجود أنواع السحابات المتينة محكمة الإغلاق.</div><div>• جيوب داخلية متعددة مبطنة وواسعة للحفاظ على مستلزماتك وأجهزتك بأمان.</div><div>• بطانة داخلية فاخرة مقاومة للتآكل.</div><div>• حامل علوي لليد.</div><div>• متعددة الجيوب والتقسيمات الخارجية.</div><div>• سحاب محكم للإغلاق.</div><div>• جيب كمبيوتر محمول مدمج وحزام تثبيت داخلي.</div><div><br></div><div><br></div><div>تفاصيل شنطة ظهرلون أسود :</div><div>العلامة التجارية للشنطة : للشنط.</div><div>اللون : لون أسود.</div><div>الطراز : 21106</div><div>الخامات : نايلون</div><div>كود المنتج : 2018000000618</div>', 'شنطة ظهر ماركة ساغالون أسود ، حقيبة ظهر بتصميم شبابي ، متعددة الاستخدامات وتتميز بحجمها المثالي لاستيعاب الكمبيوتر المستلزمات الشخصية ، متوفرة في متجر ساغا', '58.82', '4', NULL, '2', 'mvcode_image_308_885524299.jpg', 'mvcode_image_308_0_846088185.jpg|mvcode_image_308_1_1813509600.jpg|mvcode_image_308_2_1088778758.jpg|mvcode_image_308_3_1760808539.jpg', NULL, 55, '1', '2022-01-15 00:08:35', '2022-01-15 00:08:35'),
(309, '2018000000619', 'شنطة ظهر لون رمادي وأسود', 'شنطة ظهر لون رمادي وأسود', '13', '18', '5', 'الحجم: الطول 19*العرض 5*الارتفاع 23سم', NULL, 'اسود', 'البوليستر', 'Yes', 119.00, 289.00, 'LSB8374R1-05/018', '<div>شنطة ظهرلون رمادي وأسود</div><div>الوصف:&nbsp;</div><div>شنطة ظهر شبابية العالمية, شنطة يحتاجها الشباب للجامعة والعمل, توفر الراحة والسعة لاحتواء جميع الأغراض اللازمة أثناء الخروج, تكتمل مميزاتها بالتصميم الخارجي الأنيق بتناغم الألوان بين الرمادي والأسود, يتضمن تصميمها الخارجي جيوب وحامل يد وحاملين للأكتاف من نفس البطانة الطبية التي تملئ الظهر؛ حيث تسمح للشعور بمتعة أكثر أثناء الاستخدام, مختومة من العالمية في الجانب الأمامي بختم معدني ثابت يضمن جودتها.</div><div><br></div><div>مميزات شنطة ظهرلون رمادي وأسود:</div><div>• التصميم الأنيق والجيوب المتعددة.</div><div>• مصنوعة من مادة البوليستر عالية الجودة.</div><div>• حمالات كتفين مريحة قابلة لتعديل.</div><div>• سحاب الحقيبة مزدوج من أجود أنواع السحابات المتينة محكمة الإغلاق.</div><div>• جيوب داخلية متعددة مبطنة وواسعة للحفاظ على مستلزماتك وأجهزتك بأمان.</div><div>• بطانة داخلية فاخرة مقاومة للتآكل.</div><div>• حامل علوي لليد.</div><div>• متعددة الجيوب والتقسيمات الخارجية.</div><div>• سحاب محكم للإغلاق.</div><div>• جيب كمبيوتر محمول مدمج وحزام تثبيت داخلي.</div><div><br></div><div>تفاصيل شنطة ظهرلون رمادي وأسود:</div><div>العلامة التجارية للشنطة : للشنط.</div><div>اللون : لون أسود.</div><div>الطراز : 11106.</div><div>الخامات : البوليستر.</div><div>كود المنتج : 2018000000619.</div><div>sku : LSB8374R1-05/018</div>', 'شنطة ظهر ماركة ساغالون رمادي وأسود ، حقيبة ظهر مصنوعة من مادة البوليستر ، متعددة الاستخدامات وتتسع للعديد من الأغراض الشخصية وبها جيب مدمج خاص بجهاز الكمبيوتر', '58.82', '3', NULL, '2', 'mvcode_image_309_357932457.jpg', 'mvcode_image_309_0_615762039.jpg|mvcode_image_309_1_1280791786.jpg|mvcode_image_309_2_1155940130.jpg|mvcode_image_309_3_450463965.jpg', NULL, 56, '1', '2022-01-15 00:09:11', '2022-01-15 00:09:11'),
