(311, '2018000000621', 'شنطة ظهر نسائية أنيقة باللون الأزرق', 'شنطة ظهر نسائية أنيقة باللون الأزرق', '13', '18', '5', 'الحجم: الطول 19*العرض 5*الارتفاع 23سم', NULL, 'ازرق', 'نايلون', 'Yes', 59.00, 159.00, 'LSB8333-1A-05/018', '<div>شنطة ظهر نسائية أنيقة باللون الأزرق</div><div>الوصف:&nbsp;</div><div>شنطة ظهر زرقاء العالمية, شنطة يومية مثالية بمظهر عصري أنيق باللون الأزرق الاستثنائي, تصميمها ناعم وأنيق جدًا من الخارج ومنظم بسعة جيدة من الداخل, تصميمها الخارجي جذاب من خامة النايلون المتين مدمج به جلد أزرق داكن لإطلالة مميزة مع الأزياء الانتقائية, يتميز تصميمها بحامل اليد من الجلد المتين مع حمالات الأكتاف الطبية المريحة, كما تتضمن جيب خارجي بسيط وجيوب جانبية مفتوحة تستخدمها وقت الحاجة, هذه الشنطة الراقية تناسب الأذواق الاستثنائية.</div><div><br></div><div>مميزات شنطة ظهر نسائية أنيقة باللون الأزرق:</div><div>• التصميم الأنيق والجيوب المتعددة.</div><div>• مصنوعة من مادة النايلون عالي الجودة.</div><div>• حمالات كتفين مريحة قابلة لتعديل.</div><div>• سحاب الحقيبة مزدوج من أجود أنواع السحابات المتينة محكمة الإغلاق.</div><div>• جيوب داخلية متعددة مبطنة وواسعة للحفاظ على مستلزماتك وأجهزتك بأمان.</div><div>• بطانة داخلية فاخرة مقاومة للتآكل.</div><div>• حامل علوي لليد.</div><div>• متعددة الجيوب والتقسيمات الخارجية.</div><div>• سحاب محكم للإغلاق.</div><div>• جيب كمبيوتر محمول مدمج وحزام تثبيت داخلي.</div><div><br></div><div>تفاصيل شنطة ظهر نسائية أنيقة باللون الأزرق:</div><div>العلامة التجارية للشنطة : للشنط.</div><div>اللون : لون أزرق.</div><div>الطراز : 11106.</div><div>الخامات : النايلون.</div><div>كود المنتج : 2018000000621.</div><div>SKU : LSB8333-1A-05/018</div>', 'شنطة ظهر نسائية أنيقة باللون الأزرقللحقائب ، حقيبة ظهر ذات تصميم أنثوي أنيق من النايلون المتين المدمج بالجلد الأزرق المميز ، متوفرة في متجر ساغا', '62.89', '6', NULL, '2', 'mvcode_image_311_1026051506.jpg', 'mvcode_image_311_0_497929207.jpg|mvcode_image_311_1_1850456297.jpg|mvcode_image_311_2_1302165229.jpg|mvcode_image_311_3_1680598333.jpg', NULL, 58, '1', '2022-01-15 00:09:52', '2022-01-15 00:09:52'),
(312, '2018000000622', 'شنطة ظهر نسائية لون أورانج', 'شنطة ظهر نسائية لون أورانج', '13', '18', '5', 'الحجم: الطول 19*العرض 5*الارتفاع 23سم', NULL, 'اورانج', 'البوليستر', 'Yes', 79.00, 199.00, 'LSB9081M-05/018', '<div>شنطة ظهر نسائية لون أورانج</div><div>الوصف:&nbsp;</div><div>شنطة ظهر نسائية مميزة العالمية, تصميمها عصري مبتكر بأحزمة وجيوب إضافية توفر سعة أكثر للممتلكات والمستلزمات الخاصة أثناء الخروج, تتميز بحامل يد من أشرطة قماشية متينة وحمالات أكتاف طبية مريحة لمتعة استخدام مضاعفة, ألونها مميزة وتختلف في الجوانب والجيوب بين اللونين الأورانج والأبيض الناصع, مناسبة للاستخدام اليومي لإطالة فريدة غير اعتيادية.</div><div><br></div><div>مميزات شنطة ظهر نسائية لون أورانج:</div><div>• التصميم الأنيق والجيوب المتعددة.</div><div>• مصنوعة من مادة البوليستر عالية الجودة.</div><div>• حمالات كتفين مريحة قابلة لتعديل.</div><div>• سحاب الحقيبة مزدوج من أجود أنواع السحابات المتينة محكمة الإغلاق.</div><div>• جيوب داخلية متعددة مبطنة وواسعة للحفاظ على مستلزماتك وأجهزتك بأمان.</div><div>• بطانة داخلية فاخرة مقاومة للتآكل.</div><div>• حامل علوي لليد.</div><div>• متعددة الجيوب والتقسيمات الخارجية.</div><div>• سحاب محكم للإغلاق.</div><div>• جيب كمبيوتر محمول مدمج وحزام تثبيت داخلي.</div><div><br></div><div>تفاصيل شنطة ظهر نسائية لون أورانج:</div><div>العلامة التجارية للشنطة : للشنط.</div><div>اللون : لون أورانج.</div><div>الطراز : 11106.</div><div>الخامات : البوليستر.</div><div>كود المنتج : 2018000000622.</div><div>SKU : LSB9081M-05/018</div>', 'شنطة ظهر نسائية لون أورانج، حقيبة ذات تصميم عصري مبتكر بأحزمة وجيوب إضافية توفر سعة إضافية، وحامل يد من أشرطة قماشية متينة وحمالات أكتاف طبية مريحة', '60.30', '5', NULL, '2', 'mvcode_image_312_1046349914.jpg', 'mvcode_image_312_0_1551006496.jpg|mvcode_image_312_1_1441757005.jpg|mvcode_image_312_2_1199711537.jpg|mvcode_image_312_3_1307964024.jpg', NULL, 59, '1', '2022-01-15 00:10:09', '2022-01-15 00:10:09'),
(313, '2018000000626', 'صندوق اكسسوارات اسطواني', 'صندوق اكسسوارات اسطواني', '14', '19', '5', 'الحجم: الطول 19*العرض 5*الارتفاع 23سم', NULL, 'اسود', '#N/A', 'Yes', 119.00, 289.00, 'TJ2221-05/018', '<div>صندوق اكسسورات اسطواني</div><div>الوصف:&nbsp;</div><div>شنطة اكسسوارات عصرية ماركة , شنطة تأخذ شكل اسطواني أنيق يتسع لتنظيم أكبر كمية من الاكسسوارات, فهي تأتي بتصميم عملي متعدد الأقسام يستوعب الأحجام المختلفة للاكسسوارات, مصنوعة من خامات عالية الجودة, يتضمن تصميمها حامل يد علوي مع قفل معدني مثبت على محيطها الدائري, لونها الخارجي أزرق أنيق يتناغم مع لونها الداخلي الناصع, هذه الشنطة الرائعة هي ما تحتاجيه لحماية مجوهراتك الثمينة.</div><div><br></div><div>مميزات صندوق اكسسوارات اسطواني:</div><div>• التصميم الأنيق والأقسام المتعددة.</div><div>• مصنوعة من خامات عالية الجودة.</div><div>• حامل يد علوي مثبت بشكل متين.</div><div>• تقسيمات داخلية متعددة وواسعة لاستيعاب أكبر كمية من المجوهرات ذات الأحجام المختلفة.</div><div>• دروج قوية بمقابض صغيرة سهلة الفتح والإغلاق.</div><div>• بطانة داخلية فاخرة مقاومة للتآكل.</div><div>• قفل معدني لإغلاق محكم.</div><div><br></div><div>تفاصيل صندوق اكسسوارات اسطواني:</div><div>العلامة التجارية للشنطة : للشنط.</div><div>اللون : لون أزرق.</div><div>الطراز : 13104.</div><div>كود المنتج : 2018000000626.</div><div>SKU : TJ2221-05/018</div>', 'صندوق اكسسوارات اسطواني، يقدم متجر ساغا حقيبة اكسسورات أنثوية مصنوعة من خامة عالية الجودة محاطة من الداخل ببطانة فاخرة لحماية المجوهرات من التلف', '58.82', '2', NULL, '2', 'mvcode_image_313_1485188906.jpg', 'mvcode_image_313_0_753839094.jpg|mvcode_image_313_1_1746363682.jpg|mvcode_image_313_2_632520059.jpg|mvcode_image_313_3_1359185077.jpg', NULL, 60, '1', '2022-01-15 00:10:22', '2022-01-15 00:10:22'),
(314, '2018000000627', 'صندوق مجوهرات راقي بسعة تنظيم كبيرة', 'صندوق مجوهرات راقي بسعة تنظيم كبيرة', '14', '19', '5', 'الحجم: الطول 19*العرض 5*الارتفاع 23سم', NULL, 'اسود', '#N/A', 'Yes', 319.00, 799.00, 'TJ2325-05/018', '<div>صندوق مجوهرات راقي بسعة تنظيم كبيرة</div><div>الوصف:&nbsp;</div><div>شنطة مجوهرات مميزة ماركة , شنطة تأخذ شكل أنيق يتسع لتنظيم أكبر كمية من المجوهرات, تأتي بتصميم عملي متعدد الأقسام يستوعب الأحجام المختلفة للمجوهرات من (خواتم, سلاسل, أقراط, أساور, ساعات, بروشات), مصنوعة من خامات عالية الجودة, يتضمن تصميمها حامل يد علوي مع قفل رقمي TSA مثبت على محيطها بإحكام, لونها الخارجي أسود أنيق يتناغم مع لونها الداخلي الناصع, هذه الشنطة الرائعة بسعتها الكبيرة وتنظيمها الدقيق هي ما تحتاجيه لترتيب وحماية مجوهراتك الثمينة.</div><div><br></div><div>مميزات صندوق مجوهرات راقي بسعة تنظيم كبيرة:</div><div>• التصميم الأنيق والأقسام المتعددة.</div><div>• مصنوع من خامات عالية الجودة.</div><div>• حماية عالية بقفل رقمي TSA .</div><div>• حامل يد علوي مثبت بشكل متين.</div><div>• تقسيمات داخلية متعددة وواسعة لاستيعاب أكبر كمية من المجوهرات ذات الأحجام المختلفة.</div><div>• دروج قوية بمقابض صغيرة سهلة الفتح والإغلاق.</div><div>• بطانة داخلية فاخرة مقاومة للتآكل.</div><div>• قفل معدني لإغلاق محكم.</div><div>&nbsp;</div><div>تفاصيل صندوق مجوهرات راقي بسعة تنظيم كبيرة:</div><div>العلامة التجارية للشنطة : للشنط.</div><div>اللون : لون أسود.</div><div>الطراز : 13104.</div><div>كود المنتج : 2018000000627.</div><div>SKU: TJ2325-05/018</div>', 'صندوق مجوهرات راقي بسعة تنظيم كبيرة، تأخذ شكل أنيق وتصميم عملي متعدد الأقسام لحماية المجوهرات من التلف، تأتي مع قفل رقمي  TSA، متوفرة في متجر ساغا', '60.08', '0', NULL, '2', 'mvcode_image_314_1721856154.jpg', 'mvcode_image_314_0_196858798.jpg|mvcode_image_314_1_1118362581.jpg|mvcode_image_314_2_1325851585.jpg|mvcode_image_314_3_1564549589.jpg', NULL, 61, '1', '2022-01-15 00:10:36', '2022-01-15 00:10:36'),
(315, '2018000000628', 'صندوق لحفظ ساعات اليد عدد 6', 'صندوق لحفظ ساعات اليد عدد 6', '14', '20', '5', 'الحجم: الطول 19*العرض 5*الارتفاع 23سم', NULL, 'اسود', '#N/A', 'Yes', 99.00, 259.00, 'TJ2187-05/018', '<div>صندوق لحفظ ساعات اليد عدد 6</div><div>الوصف:&nbsp;</div><div>صندوق ساعات اليد الراقي من ماركة , صندوق مميز لحماية الساعات الفاخرة وحفظها في نفس المكان, معزز الصندوق بقفل حماية رقمي TSA لتبقي ساعاتك الثمينة في أمان, كما ويتميز تصميمه الداخلي بتقسيمات منظمة تسع 6 ساعات يد, مبطن بقماش ناعم يحمي ساعات اليد من الخدوش, يأتي الصندوق بغلاف جلدي فاخر مع بطانة داخلية ناعمة, هذا الصندوق الرائع المصنوع من أجود الخامات هو افضل ما قد تحصل عليه لحماية ساعات اليد.</div><div><br></div><div>مميزات صندوق لحفظ ساعات اليد عدد 6:</div><div>• التصميم الأنيق والأقسام المتعددة.</div><div>• مصنوع من خامات عالية الجودة.</div><div>• غلاف جلدي فاخر وبطانة داخلية ناعمة تحمي الساعات من الخدوش.</div><div>• بطانة داخلية فاخرة مقاومة للتآكل.</div><div>• حماية عالية بقفل رقمي TSA .</div><div>• تقسيمات داخلية تسع 6 ساعات يد.</div><div><br></div><div>تفاصيل صندوق لحفظ ساعات اليد عدد 6:</div><div>العلامة التجارية للشنطة : للشنط.</div><div>اللون : لون أسود.</div><div>الطراز : 15102.</div><div>كود المنتج : 2018000000628.</div><div>SKU : TJ2187-05/018</div>', 'صندوق لحفظ ساعات اليد عدد 6، صندوق لحفظ 6 ساعات يد ، مغطى بغلاف جلدي مع بطانة داخلية ناعمة لحمايتها من الخدوش، ومعزز بقفل رقمي  TSAلحفظها بأمان', '61.78', '2', NULL, '2', 'mvcode_image_315_2064734711.jpg', 'mvcode_image_315_0_272460346.jpg|mvcode_image_315_1_1541106035.jpg|mvcode_image_315_2_1465530631.jpg|mvcode_image_315_3_776302299.jpg', NULL, 62, '1', '2022-01-15 00:11:16', '2022-01-15 00:11:16'),
