(317, '2019000000300', 'محفظة بطاقات رجالية لون أسود', 'محفظة بطاقات رجالية لون أسود', '11', '17', '5', 'الحجم: الطول 19*العرض 5*الارتفاع 23سم', NULL, 'اسود', '#N/A', 'Yes', 49.00, 109.00, 'S01-1-11/018', '<div>محفظة بطاقات رجالية لون أسود</div><div>الوصف:&nbsp;</div><div>محفظة بطاقات بسيطة ماركة , محفظة مصنوعة من الجلد الفاخر بتصميم عصري أنيق يليق بالرجل الراقي, تقسيماتها كثيرة تتسع لعدد كبير من البطاقات المهمة, معززة بقفل دفع لإغلاق محكم يحمي الجيوب الداخلية والخارجية من سقوط البطاقات, مختومة بمن الداخل والخارج بشكل راقي على الجلد الأسود الأنيق, هذه المحفظة هي مزيج من الأناقة والبساطة في يد كل رجل راقي.</div><div><br></div><div>مميزات محفظة بطاقات رجالية لون أسود:</div><div>• التصميم الأنيق والجيوب المتعددة.</div><div>• مصنوعة من الجلد الفاخر باللون الأسود الأنيق.</div><div>• جيوب داخلية وخارجية عدد 9.</div><div>• حماية عالية بقفل دفع محكم الإغلاق.</div><div><br></div><div>تفاصيل محفظة بطاقات رجالية لون أسود:</div><div>العلامة التجارية للشنطة : للشنط.</div><div>اللون : لون أسود.</div><div>الطراز : 15107.</div><div>كود المنتج : 2019000000300.</div><div>SKU : S01-1-11/018</div>', 'محفظة بطاقات رجالية لون أسود، يقدم متجر ساغا محفظة بطايق من الجلد الفاخر وبتصميم عصري ، ذات جيوب كثيرة تتسع لعدد كبير من الكروت ومعززة بقفل دفع', '55.05', '0', NULL, '2', 'mvcode_image_317_1957719150.jpg', 'mvcode_image_317_0_1475364451.jpg|mvcode_image_317_1_2038412381.jpg|mvcode_image_317_2_1871936805.jpg|mvcode_image_317_3_2044195165.jpg', NULL, 64, '1', '2022-01-15 00:14:03', '2022-01-15 00:14:03'),
(318, '2019000000301', 'محفظة بطاقات تصميم أنيق', 'محفظة بطاقات تصميم أنيق', '11', '17', '5', 'الحجم: الطول 19*العرض 5*الارتفاع 23سم', NULL, 'اسود', '#N/A', 'Yes', 49.00, 109.00, 'B01-11/018', '<div>محفظة بطاقات راقية منقوشة باللون الأسود</div><div>الوصف:&nbsp;</div><div>محفظة بطاقات بغلاف جلدي منقوش بأناقة ماركة , محفظة مصنوعة من الجلد الفاخر بتصميم عصري أنيق يليق بالرجل الراقي, تصميمها الداخلي يتكون من جيبيين واسعين بالإضافة إلى جيب جانبي لاحتواء أكبر عدد من البطاقات المهمة, معززة بقفل دفع لإغلاق محكم يحمي الجيوب الداخلية من سقوط البطاقات, مختومة بمن الداخل بشكل راقي على الجلد الأسود الأنيق, هذه المحفظة هي مزيج من الأناقة والرقي في يد كل رجل أنيق.</div><div><br></div><div>مميزات محفظة البطاقات للرجال ماركة :</div><div>• التصميم العصري الأنيق.</div><div>• مصنوعة من الجلد الفاخر المنقوش باللون الأسود الراقي.</div><div>• جيوب داخلية بقسمين (سعة حرة) وجيب جانبي.</div><div>• حماية عالية بقفل دفع محكم الإغلاق.</div><div><br></div><div>تفاصيل محفظة البطاقات للرجال ماركة :</div><div>العلامة التجارية للشنطة : للشنط.</div><div>اللون : لون أسود.</div><div>الطراز : 15107.</div><div>كود المنتج : 2019000000301.</div><div>SKU : B01-11/018</div>', 'محفظة بطاقات ماركة ساغاتصميم أنيق بغلاف جلدي منقوش ، وتصميم الداخلي يتكون من جيبيين واسعين بالإضافة إلى جيب جانبي لاحتواء أكبر عدد من الكروت معززة بقفل دفع', '55.05', '2', NULL, '2', 'mvcode_image_318_1421945749.jpg', 'mvcode_image_318_0_930640843.jpg|mvcode_image_318_1_2068494486.jpg|mvcode_image_318_2_46159623.jpg|mvcode_image_318_3_1175566482.jpg', NULL, 65, '1', '2022-01-15 00:14:19', '2022-01-15 00:14:19'),
(319, '2019050000430', 'محفظة بطاقات لون أسود', 'محفظة بطاقات لون أسود', '11', '17', '5', 'الحجم: الطول 19*العرض 5*الارتفاع 23سم', NULL, 'اسود', '#N/A', 'Yes', 49.00, 109.00, 'AC01-04/019', '<div>محفظة بطاقات أنيقة لون أسود</div><div><br></div><div>الوصف:&nbsp;</div><div>محفظة بطاقات للرجال بغلاف جلدي أنيق ماركة , محفظة مصنوعة من الجلد الفاخر بتصميم عصري مميز يليق بالرجل الراقي, تصميمها الداخلي يتكون من جيب واسع بالإضافة إلى 9 جيوب داخلية لاحتواء أكبر عدد من البطاقات المهمة, معززة بقفل دفع لإغلاق محكم يحمي الجيوب الداخلية من سقوط البطاقات, لون جلدها أسود أنيق, هذه المحفظة هي كل ما تحتاج لتنظيم بطاقاتك المهمة.</div><div><br></div><div>مميزات محفظة البطاقات للرجال ماركة :</div><div>• التصميم العصري الأنيق.</div><div>• مصنوعة من الجلد الفاخر باللون الأسود الراقي.</div><div>• جيوب داخلية بقسم (سعة حرة) و9 جيوب جانبية.</div><div>• حماية عالية بقفل دفع محكم الإغلاق.</div><div><br></div><div>تفاصيل محفظة البطاقات للرجال ماركة :</div><div>العلامة التجارية للشنطة : للشنط.</div><div>اللون : لون أسود.</div><div>الطراز : 15107.</div><div>كود المنتج : 2019050000430.</div><div>SKU : AC01-04/019</div>', 'محفظة بطاقات ماركة ساغالون أسود ، محفظة رجالية من الجلد الفاخر بتصميم عصري، بها جيب واسع بالإضافة لـ 9 جيوب داخلية لاحتواء أكبر عدد من الكروت ومعززة بقفل دفع', '55.05', '0', NULL, '2', 'mvcode_image_319_666460754.jpg', 'mvcode_image_319_0_2117522247.jpg|mvcode_image_319_1_1094765505.jpg|mvcode_image_319_2_1827034109.jpg|mvcode_image_319_3_474718244.jpg', NULL, 66, '1', '2022-01-15 00:14:32', '2022-01-15 00:14:32'),
(320, '2021000002915', 'شنطة يد نسائية مميزة بغلاف منقوش بجلد الحية لون أسود', 'شنطة يد نسائية مميزة بغلاف منقوش بجلد الحية لون أسود', '10', '15', '5', 'الحجم: الطول 12.5 *العرض 2.5 *الارتفاع 10سم', NULL, 'أسود', 'البولي يوريثين', 'Yes', 229.00, 389.00, 'W20430-12/020', '<div>شنطة يد نسائية مميزة بغلاف منقوش بجلد الحية لون أسود&nbsp;</div><div>الوصف:&nbsp;</div><div>شنطة يد نسائية مميزة بغلاف منقوش بجلد الحية لون أسود من العالمية، شنطة عصرية بتصميم أنيق يواكب الموضة الحديثة، مصنوعة من أجود الجلود وكما في الغلاف نقشة جلد الحية بتدرجات اللون الأسود والرمادي، حجمها المميز يناسب حملها في اليد بشكل أنيق، معززة بقفل خارجي متين بلون لامع ثابت، تصميمها الخارجي يحتوي على جيب خلفي كما أن تصميمها الداخلي غني بالجيوب والتقسيمات لتنظيم البطاقات والاموال، هذه الشنطة المميزة من تناسب الاستخدام للمناسبات والأوقات النهارية والليلية بفضل الأناقة التي تضيفها إلى إطلالتك.</div><div>تتوفر هذه الشنطة بألوان راقية (أسود، جملي)</div><div><br></div><div>مميزات شنطة نسائية ماركة :</div><div>• خفيفة الوزن.</div><div>• سهلة الحمل في اليد.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• تتميز بقاعدة صلبة.</div><div>• شكل الحقيبة متناسق الأبعاد.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• مقاوم للماء والغبار.</div><div><br></div><div>تفاصيل شنطة يد نسائية باللون الأسود:</div><div>العلامة التجارية للشنطة : للحقائب النسائية .</div><div>اللون : أسود.</div><div>الطراز : 11102.</div><div>الخامات : البولي يوريثين.</div><div>كود المنتج : 2021000003035.</div><div>الأبعاد : 12.5* 2.5* 10 سم</div>', 'شنطة يد نسائية مميزة بغلاف منقوش بجلد الحية لون أسود، حقيبة عصرية مصنوعة من أجود الجلود وكما في الغلاف نقشة جلد الحية بتدرجات اللون الأسود والرمادي', '41.13', '1', NULL, '2', 'mvcode_image_320_1183711956.jpg', 'mvcode_image_320_0_657353656.jpg|mvcode_image_320_1_1119507830.jpg|mvcode_image_320_2_163791942.jpg|mvcode_image_320_3_123399085.jpg', NULL, 67, '1', '2022-01-15 00:15:02', '2022-01-15 00:15:02'),
