(462, '2021051700891', 'محفظة رجال بتصميم انيق جلد طبيعي', 'محفظة رجال بتصميم انيق جلد طبيعي', '11', '17', '5', 'الحجم: الطول 11.5*العرض 1.5*الارتفاع 9سم', NULL, 'اسود', 'جلد', 'Yes', 169.00, 239.00, 'DB01-05/021', '<div>شنطة كتف رجالية لون أسود – ماركة ساغا</div><div><br></div><div>الوصف:</div><div>شنطة كتف رجاليه رائعة وعصرية من ساغا، باللون الأسود الراقي تمنحك إطلالة شبابية جذابة ومميزة، مصممة بدقة عالية وبأجود الخامات الأصلية 100% من البولي يوريثين عالي الجودة المقاوم للماء ، يمنح كل شاب مساحة مثالية بأقل حجم لحمل مستلزماته وأغراضه الشخصية، تفاصيل راقية من الطراز الرفيع بحجم مثالي لجميع المشاوير اليومية.</div><div><br></div><div>مميزات شنطة كتف رجالية لون أسود – ماركة ساغا:</div><div>• شنطة رجاليه بتصميم من الطراز الفاخر ذو طابع عصري باللون الأسود.</div><div>• حزام كتف قابل للتعديل</div><div>• سحاب الحقيبة من أجود أنواع السحابات المتينة محكمة الإغلاق.</div><div>• جيوب داخلية مبطنة وواسعة.</div><div>• شنطة رجاليه خفيفة الوزن.</div><div>• شنط الرجالية من ساغا مصنوعة من أجود الخامات المقاومة للتآكل والتلف.</div><div>• مناسبة جداً لحفظ البطاقات المصرفية وبطاقات العمل والأوراق النقدية.</div><div>• حجم مثالي ومميز لكل شاب أنيق يعشق الإطلالات الرفيعة.</div><div>• بطانة داخلية فاخرة مقاومة للتآكل</div><div><br></div><div>تفاصيل شنطة كتف رجاليه ساغا لون أسود:</div><div>العلامة التجارية للشنطة : ماركة ساغا للشنط رجاليه.</div><div>اللون : لون أسود.</div><div>الطراز : 21102</div><div>الخامات : البولي يوريثين</div><div>كود المنتج : 2019050000178</div><div>الأبعاد : L19*W6*H22cm</div><div>SKU : 82816-04/019</div>', 'شنطة نسائية أنيقة بنقشة الراقية، حقيبة مصممة بأناقة', '29.29', '7', NULL, '2', 'mvcode_image_462_888898254.jpg', 'mvcode_image_462_0_844514314.jpg|mvcode_image_462_1_322048737.jpg|mvcode_image_462_2_1093679653.jpg|mvcode_image_462_3_2002116673.jpg', NULL, 209, '1', '2022-01-15 01:02:24', '2022-01-15 01:02:24'),
(463, '2021051700907', 'محفظة رجال بتصميم انيق جلد طبيعي', 'محفظة رجال بتصميم انيق جلد طبيعي', '11', '17', '5', 'الحجم: الطول 11.5*العرض 1.5*الارتفاع 9سم', NULL, 'قهوي داكن', 'جلد', 'Yes', 169.00, 239.00, 'DB01-05/021', '<div>محفظة راقية من ساغا&nbsp;&nbsp;</div><div>الوصف:&nbsp;</div><div>محفظة&nbsp; بغلاف جلدي انيقة ماركة ساغا, محفظة مصنوعة من الجلد الفاخر بتصميم عصري أنيق يليق بالرجل الراقي, تصميمها الداخلي يتكون من جيبيين واسعين بالإضافة إلى جيب جانبي لاحتواء أكبر عدد من البطاقات المهمة, مختومة بماركة ساغا من الداخل بشكل راقي على الجلد االأنيق, هذه المحفظة هي مزيج من الأناقة والرقي في يد كل رجل أنيق.</div><div><br></div><div>مميزات محفظة البطاقات للرجال ماركة ساغا:</div><div>• التصميم العصري الأنيق.</div><div>• مصنوعة من الجلد الطبيعي الفاخر&nbsp;</div><div>• جيوب داخلية بقسمين (سعة حرة) وجيب جانبي.</div>', 'شنطة نسائية أنيقة بنقشة الراقية، حقيبة مصممة بأناقة', '29.29', '4', NULL, '2', 'mvcode_image_463_859018069.jpg', 'mvcode_image_463_0_1014833030.jpg|mvcode_image_463_1_1989665477.jpg|mvcode_image_463_2_1489036459.jpg|mvcode_image_463_3_246162203.jpg', NULL, 210, '1', '2022-01-15 01:02:39', '2022-01-15 01:02:39'),
