(458, '2021051700792', 'شنطة نسائية أنيقة', 'شنطة نسائية أنيقة', '10', '15', '5', 'الحجم: الطول 32*العرض 12.5*الارتفاع 26سم', NULL, 'بني', 'البولي فينيل كلورايد', 'Yes', 349.00, 439.00, 'B202-05/021', '<div>عنوان المنتج:&nbsp;&nbsp;</div><div>شنطة نسائية أنيقة بنية بتصميم ساغا المميز&nbsp;</div><div>الوصف:&nbsp;</div><div>شنطة يد أنيقة للصبايا بتصميم عصري أنيق بالألوان البني، مع تصميم بألوان متناسقة في الأمام و الخلف يضيف لمسة تميز للشنطة العصرية، مضاف إلى أحزمة الكتفين الأساسيين في الشنطة حامل يد اختياري باللون المارون لتسهيل حمل الشنطة ولإراحة الكتفين أثناء الخروج، هذه الشنطة الراقية جدًا من ماركة ساغا تناسب فئة الصبايا حيث تخدمهم بشكل جيد أثناء الخروج في الأوقات النهارية.</div><div>مميزات شنطة كتف :</div><div>• خفيفة الوزن.</div><div>• حزام إضافي.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• الوان راقية&nbsp;</div><div>• بطانة داخلية متينة.</div><div>• مقاوم للماء والغبار.</div>', 'شنطة نسائية أنيقة بنقشة الراقية، حقيبة مصممة بأناقة', '20.50', '4', NULL, '2', 'mvcode_image_458_508879336.jpg', 'mvcode_image_458_0_1412486055.jpg|mvcode_image_458_1_363282558.jpg|mvcode_image_458_2_986258088.jpg|mvcode_image_458_3_1528658721.jpg|mvcode_image_458_4_143405951.jpg', NULL, 205, '1', '2022-01-15 01:01:34', '2022-01-15 01:01:34'),
(457, '2021051700785', 'شنطة نسائية أنيقة', 'شنطة نسائية أنيقة', '10', '15', '5', 'الحجم: الطول 20*العرض 11*الارتفاع 13', NULL, 'بيج', 'البولي فينيل كلورايد', 'Yes', 269.00, 339.00, 'S100-05/021', '<div>عنوان المنتج:&nbsp;&nbsp;</div><div>شنطة كروس نسائية بني وكاكي بسلسلة علوية – ماركة ساغا</div><div>الوصف:&nbsp;</div><div>شنطة نسائية باللون البني والكاكي الراقي مصممة بشريط أحمر اللون وسط الشنطة وسلسلة علوية منفردة ذات لون ذهبي لامع، من أحدث إصدارات ماركة ساغا للحقائب العالمية، سهلة الحمل بحزام جلدي متين باللون البني الأنيق وسلاسل ناعمة ومميزة، تضيف إليها لمسة عصرية تجعلها مناسبة للاستخدام اليومي وللمناسبات النهارية، حيث صنفت حقيبة اليد على أنها الأكثر تميزاً في المجموعة وذلك احتواء على إطار من الجلد على محيط الشنطة وتصميمها&nbsp; الخلفي المطعم بديزاين جلد بني مميز.</div><div>مميزات شنطة كروس نسائية بسلسلة علوية:</div><div>• خفيفة الوزن.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• ألوان راقية كلاسيكية من البني والأسود.</div><div>• تناغم زخارف المنظمة وشكل الحقيبة الصغيرة.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• حزام الكتف من الجلد المتين باللون الأسود الأنيق.</div><div>• تتميز بشريط وسط باللون الأحمر الراقي.</div><div>• مقاوم للماء والغبار.</div><div><br></div><div>تفاصيل شنطة كروس نسائية باللون البني والكاكي:</div><div>العلامة التجارية للشنطة : ماركة ساغا للحقائب .</div><div>اللون : البني والكاكي.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001826</div><div>الأبعاد:&nbsp; &nbsp; 22 * 7 * 14.5&nbsp; سم</div><div>sku: B61-12/020</div>', 'شنطة نسائية أنيقة بنقشة الراقية، حقيبة مصممة بأناقة', '20.65', '3', NULL, '2', 'mvcode_image_457_1340452908.jpg', 'mvcode_image_457_0_1637648306.jpg|mvcode_image_457_1_813746395.jpg|mvcode_image_457_2_1874734776.jpg|mvcode_image_457_3_542197419.jpg|mvcode_image_457_4_1615084805.jpg', NULL, 204, '1', '2022-01-15 01:01:23', '2022-01-15 01:01:23'),
(456, '2021051700778', 'شنطة نسائية أنيقة', 'شنطة نسائية أنيقة', '10', '15', '5', 'الحجم: الطول 20*العرض 11*الارتفاع 13', NULL, 'بني', 'البولي فينيل كلورايد', 'Yes', 269.00, 339.00, 'S100-05/021', '<div>عنوان المنتج:&nbsp;&nbsp;</div><div>شنطة كروس نسائية بني وأسود بسلسلة علوية – ماركة ساغا</div><div>الوصف:&nbsp;</div><div>شنطة نسائية باللون البني والأسود الراقي مصممة بشريط أحمر اللون وسط الشنطة وسلسلة علوية منفردة ذات لون ذهبي لامع، من أحدث إصدارات ماركة ساغا للحقائب العالمية، سهلة الحمل بحزام جلدي متين باللون الأسود الأنيق وسلاسل ناعمة ومميزة، تضيف إليها لمسة عصرية تجعلها مناسبة للاستخدام اليومي وللمناسبات النهارية، حيث صنفت حقيبة اليد على أنها الأكثر تميزاً في المجموعة وذلك احتواء على إطار من الجلد على محيط الشنطة وتصميمها&nbsp; الخلفي المطعم بديزاين جلد أسود مميز.</div><div>مميزات شنطة كروس نسائية بسلسلة علوية:</div><div>• خفيفة الوزن.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• ألوان راقية كلاسيكية من البني والأسود.</div><div>• تناغم زخارف المنظمة وشكل الحقيبة الصغيرة.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• حزام الكتف من الجلد المتين باللون الأسود الأنيق.</div><div>• تتميز بشريط وسط باللون الأحمر الراقي.</div><div>• مقاوم للماء والغبار.</div><div><br></div><div>تفاصيل شنطة كروس نسائية باللون البني والأسود:</div><div>العلامة التجارية للشنطة : ماركة ساغا للحقائب .</div><div>اللون : البني والأسود.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001819</div><div>الأبعاد 22: * 7 * 14.5&nbsp; سم</div><div>sku: B61-12/020</div>', 'شنطة نسائية أنيقة بنقشة الراقية، حقيبة مصممة بأناقة', '20.65', '4', NULL, '2', 'mvcode_image_456_1533181970.jpg', 'mvcode_image_456_0_160521643.jpg|mvcode_image_456_1_86565528.jpg|mvcode_image_456_2_1021241040.jpg|mvcode_image_456_3_49863034.jpg|mvcode_image_456_4_231576401.jpg', NULL, 203, '1', '2022-01-15 01:00:28', '2022-01-15 01:00:28'),
(455, '2021051700761', 'شنطة نسائية أنيقة', 'شنطة نسائية أنيقة', '10', '15', '5', 'الحجم: الطول 22*العرض 10*الارتفاع 16', NULL, 'بيج', 'البولي فينيل كلورايد', 'Yes', 299.00, 379.00, 'S99-05/021', '<div>عنوان المنتج:&nbsp;</div><div>شنطة نسائية بني بشريط قفل جلدي – ماركة ساغا</div><div>الوصف:&nbsp;</div><div>شنطة نسائية باللون البني والكاكي مصممة بزخرفة عصرية منتظمة لافتة التميّز، مضاف إليها قفل جلدي مميز لإغلاق محكم، مرفق بتصميم الشنطة حزامين اختياري لليد والكتف باللون الكاكي الرائع من الجلد المتين لتناسب اختلاف المناسبات والأوقات النهارية والليلية حيث تصبح سهلة الحمل، مضاف إليها لمسة اكسسوار ناعمة على القفل وقاعدة محمية بجلد كاكي بنفس خامة الحزام تحميها من الخدوش، هذه الشنطة هي واحدة من التصاميم المميزة لدى شركة ساغا للشنط النسائية العصرية الأنيقة.</div><div>مميزات شنطة نسائية بشريط قفل جلدي:</div><div>• أحزمة ثابتة\\اختيارية.</div><div>• خفيفة الوزن.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• تتميز بقاعدة محمية الجوانب.</div><div>• ألوان راقية من البني والكاكي.</div><div>• تناغم الزخارف المنتظمة وشكل الحقيبة متناسب الأبعاد.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• حزام الكتف من الجلد المتين باللون الكاكي الأنيق.</div><div>• مقاوم للماء والغبار.</div><div>تفاصيل شنطة نسائية باللون البني والكاكي:</div><div>العلامة التجارية للشنطة : ماركة ساغا للحقائب النسائية .</div><div>اللون : البني والكاكي.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001802.</div><div>الأبعاد : 20* 11* 19* 17 سم.</div><div>sku: B60-12/020</div>', 'شنطة نسائية أنيقة بنقشة الراقية، حقيبة مصممة بأناقة', '21.11', '4', NULL, '2', 'mvcode_image_455_762912490.jpg', 'mvcode_image_455_0_2136167644.jpg|mvcode_image_455_1_702783194.jpg|mvcode_image_455_2_170607565.jpg|mvcode_image_455_3_1089157392.jpg|mvcode_image_455_4_568329074.jpg', NULL, 202, '1', '2022-01-15 01:00:17', '2022-01-15 01:00:17'),
(454, '2021051700754', 'شنطة نسائية أنيقة', 'شنطة نسائية أنيقة', '10', '15', '5', 'الحجم: الطول 22*العرض 10*الارتفاع 16', NULL, 'بني', 'البولي فينيل كلورايد', 'Yes', 299.00, 379.00, 'S99-05/021', '<div>عنوان المنتج:&nbsp;</div><div>شنطة نسائية أسود وبني غامق بشريط قفل جلدي – ماركة ساغا</div><div>الوصف:&nbsp;</div><div>شنطة نسائية بلون الكافي الغامق المذهل, مصممة بزخرفة عصرية منتظمة لافتة التميّز، مضاف إليها قفل جلدي مميز لإغلاق محكم، مرفق بتصميم الشنطة حزامين اختياري لليد والكتف باللون الأسود من الجلد المتين لتناسب اختلاف المناسبات والأوقات النهارية والليلية حيث تصبح سهلة الحمل، مضاف إليها لمسة اكسسوار ناعمة على القفل وقاعدة محمية بجلد أسود بنفس خامة الحزام تحميها من الخدوش، هذه الشنطة هي واحدة من التصاميم المميزة لدى شركة ساغا للشنط النسائية العصرية الأنيقة.</div><div>مميزات شنطة نسائية سوداء بشريط قفل جلدي:</div><div>• أحزمة ثابتة\\اختيارية.</div><div>• خفيفة الوزن.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• تتميز بقاعدة محمية الجوانب.</div><div>• ألوان راقية وكلاسيكية الأسود والكافي الغامق.</div><div>• تناغم الزخارف المنتظمة وشكل الحقيبة متناسب الأبعاد.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• حزام الكتف من الجلد المتين باللون الأسود الأنيق.</div><div>• مقاوم للماء والغبار.</div><div>تفاصيل شنطة نسائية باللون الأسود\\الكافي الغامق:</div><div>العلامة التجارية للشنطة : ماركة ساغا للحقائب النسائية.</div><div>اللون : الأسود\\الكافي الغامق.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001796.</div><div>الأبعاد : 20* 11* 19* 17 سم.</div><div>sku: B60-12/020</div>', 'شنطة نسائية أنيقة بنقشة الراقية، حقيبة مصممة بأناقة', '21.11', '3', NULL, '2', 'mvcode_image_454_813800668.jpg', 'mvcode_image_454_0_184427267.jpg|mvcode_image_454_1_1045918299.jpg|mvcode_image_454_2_364708850.jpg|mvcode_image_454_3_1772727737.jpg|mvcode_image_454_4_1554956797.jpg', NULL, 201, '1', '2022-01-15 01:00:05', '2022-01-15 01:00:05'),
(453, '2021051700747', 'شنطة نسائية أنيقة', 'شنطة نسائية أنيقة', '10', '15', '5', 'الحجم: الطول 20*العرض 10*الارتفاع 19سم', NULL, 'بيج', 'البولي فينيل كلورايد', 'Yes', 299.00, 379.00, 'S98-05/021', '<div>عنوان المنتج:&nbsp;</div><div>شنطة نسائية بنية بحزام كروس اختياري – ماركة ساغا</div><div>الوصف:&nbsp;</div><div>شنطة يد نسائية مزخرفة بتصميم أنيق منتظم باللون البني والكاكي، محاطة بإطار جلدي باللون الكاكي يعطي الشنطة هيكل متين ومنظم، ملحق بها حزام يد ثابت واخر كروس اختياري من خامة جلدية لينة تُظهر جمالية الشنطة أثناء الحمل، إضافة إلى حجمها المميز للمناسبات فهي شنطة عملية عصرية مع لفتة راقية لختم ماركة ساغا على الجانبين الأمامي والخلفي تظهر تفرّد الشنطة بجاذبية أنيقة.</div><div>مميزات شنطة نسائية بنية بحزام كتف اختياري:</div><div>• أحزمة ثابتة\\اختيارية.</div><div>• خفيفة الوزن.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• مدمج تصميمها بألوان كلاسيكية راقية من البني والكاكي.</div><div>• تناغم الزخارف المنتظمة وشكل الحقيبة متناسب الأبعاد.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• مقاوم للماء والغبار.</div><div><br></div><div>تفاصيل شنطة نسائية باللون البني\\الكاكي:</div><div>العلامة التجارية للشنطة : ماركة ساغا للحقائب النسائية.</div><div>اللون : البني\\الكاكي.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001789.</div><div>الأبعاد : 24* 8* H15.5 سم.</div><div>sku: B59-12/020</div>', 'شنطة نسائية أنيقة بنقشة الراقية، حقيبة مصممة بأناقة', '21.11', '4', NULL, '2', 'mvcode_image_453_188445423.jpg', 'mvcode_image_453_0_229267919.jpg|mvcode_image_453_1_873312386.jpg|mvcode_image_453_2_1795805952.jpg|mvcode_image_453_3_294740473.jpg|mvcode_image_453_4_1686420338.jpg', NULL, 200, '1', '2022-01-15 00:59:53', '2022-01-15 00:59:53'),
(452, '2021051700730', 'شنطة نسائية أنيقة', 'شنطة نسائية أنيقة', '10', '15', '5', 'الحجم: الطول 20*العرض 10*الارتفاع 19سم', NULL, 'بني', 'البولي فينيل كلورايد', 'Yes', 299.00, 379.00, 'S98-05/021', '<div>عنوان المنتج:&nbsp;</div><div>شنطة نسائية سوداء بحزام كروس اختياري – ماركة ساغا</div><div>الوصف:&nbsp;</div><div>شنطة يد نسائية مزخرفة بتصميم أنيق منتظم باللون الأسود، محاطة بإطار جلدي باللون الأسود يعطي الشنطة هيكل متين ومنظم، ملحق بها حزام يد ثابت واخر كروس اختياري من خامة جلدية لينة تُظهر جمالية الشنطة أثناء الحمل، إضافة إلى حجمها المميز للمناسبات فهي شنطة عملية عصرية مع لفتة راقية لختم ماركة ساغا على الجانبين الأمامي والخلفي تظهر تفرّد الشنطة بجاذبية أنيقة.</div><div>مميزات شنطة نسائية سوداء بحزام كتف اختياري:</div><div>• أحزمة ثابتة\\اختيارية.</div><div>• خفيفة الوزن.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• مدمج تصميمها بألوان كلاسيكية راقية من الأسود\\الكافي الغامق.</div><div>• تناغم الزخارف المنتظمة وشكل الحقيبة متناسب الأبعاد.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• مقاوم للماء والغبار.</div><div><br></div><div>تفاصيل شنطة نسائية باللون الأسود\\الكافي الغامق:</div><div>العلامة التجارية للشنطة : ماركة ساغا للحقائب النسائية.</div><div>اللون : الأسود\\الكافي الغامق.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001772.</div><div>الأبعاد : 24* 8* 15.5 سم.</div><div>sku: B59-12/020</div>', 'شنطة نسائية أنيقة بنقشة الراقية، حقيبة مصممة بأناقة', '21.11', '4', NULL, '2', 'mvcode_image_452_1543902156.jpg', 'mvcode_image_452_0_854461741.jpg|mvcode_image_452_1_2006778575.jpg|mvcode_image_452_2_2102420230.jpg|mvcode_image_452_3_209081124.jpg|mvcode_image_452_4_1979346226.jpg', NULL, 199, '1', '2022-01-15 00:59:38', '2022-01-15 00:59:38'),
(451, '2021051700723', 'شنطة نسائية أنيقة', 'شنطة نسائية أنيقة', '10', '15', '5', 'الحجم: الطول 23*العرض 11*الارتفاع 22سم', NULL, 'بيج', 'البولي فينيل كلورايد', 'Yes', 329.00, 409.00, 'S97-05/021', '<div>عنوان المنتج:&nbsp;</div><div>شنطة نسائية بقفل لامع وجيب خارجي بني – ماركة ساغا</div><div>الوصف:&nbsp;</div><div>شنطة يد نسائية بجيب خارجي يحميها قفل لامع مع شريط بأزرار معدنية، بتصميم زخرفة مكرر أنيق باللون البني يتخلله الجلد الكاكي البارز في الغلاف الخارجي وحزام اليد الثابت وحزام الكتف الاختياري، تجعل الأحزمة اختيارات تنسيق الشنطة متعددة لتتناسب مع الأزياء المختلفة، كما ويعطي شكلها المستطيل المتناسق رتابة للمظهر وبفضل الغلاف الخارجي المزود بشريط أزرار معدنية فإن الشنطة عملية وتحافظ على الممتلكات الخاصة آمنة أثناء الخروج.&nbsp;</div><div>مميزات شنطة نسائية بقفل لامع وجيب خارجي:</div><div>• أحزمة ثابتة\\اختيارية.</div><div>• خفيفة الوزن.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• الوان راقية كلاسيكية البني\\الكاكي.</div><div>• تناغم الزخارف المنتظمة وشكل الحقيبة متناسب الأبعاد.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• أحزمة من الجلد باللون الكاكي الأنيق.</div><div>• مقاوم للماء والغبار.</div><div><br></div><div>تفاصيل شنطة نسائية باللون البني\\الكاكي:</div><div>العلامة التجارية للشنطة : ماركة ساغا للحقائب النسائية.</div><div>اللون : البني\\الكاكي.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001765.</div><div>الأبعاد : 28* 9* 17سم.</div><div>sku: B58-12/020</div>', 'شنطة نسائية أنيقة بنقشة الراقية، حقيبة مصممة بأناقة', '19.56', '3', NULL, '2', 'mvcode_image_451_1654591582.jpg', 'mvcode_image_451_0_1794413098.jpg|mvcode_image_451_1_326971042.jpg|mvcode_image_451_2_1603860538.jpg|mvcode_image_451_3_1446047680.jpg|mvcode_image_451_4_860825355.jpg', NULL, 198, '1', '2022-01-15 00:59:28', '2022-01-15 00:59:28'),
