(384, '2021000001833', 'شنطة نسائية بني وأسود بقفل مثلث ذهبي', 'شنطة نسائية بني وأسود بقفل مثلث ذهبي', '10', '15', '5', 'الحجم: الطول 23.5*العرض 7.5*الارتفاع 14سم', NULL, 'البني والأسود.', 'البولي فينيل كلورايد', 'Yes', 229.00, 389.00, 'B62-12/020', '<div>عنوان المنتج:&nbsp;&nbsp;</div><div>شنطة نسائية بني وأسود بقفل مثلث ذهبي&nbsp;</div><div>الوصف:&nbsp;</div><div>شنطة نسائية باللون البني والأسود الراقي مصممة بقفل متفرد على شكل مثلث ذهبي وسلسلة علوية منفردة ذات لون ذهبي لامع، من أحدث إصدارات للحقائب العالمية، سهلة الحمل بحزام جلدي متين باللون الأسود الأنيق، مرفق بتصميمها سلسلة علوية ذهبية تضيف إليها لمسة عصرية تجعلها مناسبة للاستخدام اليومي وللمناسبات النهارية، حيث صنفت حقيبة اليد على أنها الأكثر تميزاً في المجموعة وذلك احتواء على إطار من الجلد على محيط الشنطة وتصميمها&nbsp; الخلفي المطعم بديزاين جلد أسود مميز.</div><div>مميزات شنطة نسائية بقفل مثلث ذهبي:</div><div>• خفيفة الوزن.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• ألوان راقية كلاسيكية من البني والأسود.</div><div>• تناغم زخارف المنظمة وشكل الحقيبة الصغيرة.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• حزام الكتف من الجلد المتين باللون الأسود الأنيق.</div><div>• تتميز بوجود قفل على شكل مثلث ذو اللون الذهبي الراقي.</div><div>• مقاوم للماء والغبار.</div><div><br></div><div><br></div><div><br></div><div>تفاصيل شنطة نسائية باللون البني والأسود:</div><div>العلامة التجارية للشنطة : للحقائب .</div><div>اللون : البني والأسود.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001833</div><div>الأبعاد : 23.5 * 7.5 * 14 سم</div><div>sku: B62-12/020</div>', 'شنطة نسائية بني وأسود بقفل مثلث ذهبي، من أحدث الإصدارات في متجر  وصنفت بأنها الأكثر تميزا في المجموعة لتصميمها وزخرفتها وإطارها الجلدي المميز', '41.13', '3', NULL, '2', 'mvcode_image_384_1153146135.jpg', 'mvcode_image_384_0_1726942794.jpg|mvcode_image_384_1_846241022.jpg|mvcode_image_384_2_552267967.jpg|mvcode_image_384_3_107413416.jpg|mvcode_image_384_4_58774236.jpg', NULL, 131, '1', '2022-01-15 00:36:08', '2022-01-15 00:36:08'),
(383, '2021000001826', 'شنطة كروس نسائية بني وكاكي بسلسلة علوية', 'شنطة كروس نسائية بني وكاكي بسلسلة علوية', '10', '15', '5', 'الحجم: الطول 22*العرض 7*الارتفاع 14.5سم', NULL, 'البني والكاكي.', 'البولي فينيل كلورايد', 'Yes', 219.00, 369.00, 'B61-12/020', '<div>عنوان المنتج:&nbsp;&nbsp;</div><div>شنطة كروس نسائية بني وكاكي بسلسلة علوية&nbsp;</div><div>الوصف:&nbsp;</div><div>شنطة نسائية باللون البني والكاكي الراقي مصممة بشريط أحمر اللون وسط الشنطة وسلسلة علوية منفردة ذات لون ذهبي لامع، من أحدث إصدارات للحقائب العالمية، سهلة الحمل بحزام جلدي متين باللون البني الأنيق وسلاسل ناعمة ومميزة، تضيف إليها لمسة عصرية تجعلها مناسبة للاستخدام اليومي وللمناسبات النهارية، حيث صنفت حقيبة اليد على أنها الأكثر تميزاً في المجموعة وذلك احتواء على إطار من الجلد على محيط الشنطة وتصميمها&nbsp; الخلفي المطعم بديزاين جلد بني مميز.</div><div>مميزات شنطة كروس نسائية بسلسلة علوية:</div><div>• خفيفة الوزن.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• ألوان راقية كلاسيكية من البني والأسود.</div><div>• تناغم زخارف المنظمة وشكل الحقيبة الصغيرة.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• حزام الكتف من الجلد المتين باللون الأسود الأنيق.</div><div>• تتميز بشريط وسط باللون الأحمر الراقي.</div><div>• مقاوم للماء والغبار.</div><div><br></div><div>تفاصيل شنطة كروس نسائية باللون البني والكاكي:</div><div>العلامة التجارية للشنطة : للحقائب .</div><div>اللون : البني والكاكي.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001826</div><div>الأبعاد:&nbsp; &nbsp; 22 * 7 * 14.5&nbsp; سم</div><div>sku: B61-12/020</div>', 'شنطة كروس نسائية بني وكاكي بسلسلة علوية ، مصممة بشريط أحمر وسط الشنطة وسلسلة ذات لون ذهبي لامع، من أحدث إصدارات للحقائب العالمية', '40.65', '2', NULL, '2', 'mvcode_image_383_754479297.jpg', 'mvcode_image_383_0_837234078.jpg|mvcode_image_383_1_513933621.jpg|mvcode_image_383_2_853812442.jpg|mvcode_image_383_3_276167757.jpg|mvcode_image_383_4_1667525774.jpg', NULL, 130, '1', '2022-01-15 00:35:36', '2022-01-15 00:35:36'),
