-15 00:35:21'),
(381, '2021000001802', 'شنطة نسائية بني بشريط قفل جلدي', 'شنطة نسائية بني بشريط قفل جلدي', '10', '15', '5', 'الحجم: الطول 20*العرض 11*الارتفاع 19*17سم', NULL, 'البني والكاكي.', 'البولي فينيل كلورايد', 'Yes', 219.00, 369.00, 'B60-12/020', '<div>عنوان المنتج:&nbsp;</div><div>شنطة نسائية بني بشريط قفل جلدي&nbsp;</div><div>الوصف:&nbsp;</div><div>شنطة نسائية باللون البني والكاكي مصممة بزخرفة عصرية منتظمة لافتة التميّز، مضاف إليها قفل جلدي مميز لإغلاق محكم، مرفق بتصميم الشنطة حزامين اختياري لليد والكتف باللون الكاكي الرائع من الجلد المتين لتناسب اختلاف المناسبات والأوقات النهارية والليلية حيث تصبح سهلة الحمل، مضاف إليها لمسة اكسسوار ناعمة على القفل وقاعدة محمية بجلد كاكي بنفس خامة الحزام تحميها من الخدوش، هذه الشنطة هي واحدة من التصاميم المميزة لدى شركة&nbsp; للشنط النسائية العصرية الأنيقة.</div><div>مميزات شنطة نسائية بشريط قفل جلدي:</div><div>• أحزمة ثابتة\\اختيارية.</div><div>• خفيفة الوزن.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• تتميز بقاعدة محمية الجوانب.</div><div>• ألوان راقية من البني والكاكي.</div><div>• تناغم الزخارف المنتظمة وشكل الحقيبة متناسب الأبعاد.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• حزام الكتف من الجلد المتين باللون الكاكي الأنيق.</div><div>• مقاوم للماء والغبار.</div><div>تفاصيل شنطة نسائية باللون البني والكاكي:</div><div>العلامة التجارية للشنطة : للحقائب النسائية .</div><div>اللون : البني والكاكي.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001802.</div><div>الأبعاد : 20* 11* 19* 17 سم.</div><div>sku: B60-12/020</div>', 'شنطة نسائية بني وكاكي بشريط قفل جلدي، تجمع ما بين التصميم العصري والعملي ، مصممة بزخرفة عصرية ومصنوعة من خامة لينة خفيفة ولها أحزمة قابلة للتعديل', '40.65', '2', NULL, '2', 'mvcode_image_381_2094999396.jpg', 'mvcode_image_381_0_455842805.jpg|mvcode_image_381_1_820368905.jpg|mvcode_image_381_2_2006685107.jpg|mvcode_image_381_3_1659934223.jpg|mvcode_image_381_4_1393289428.jpg', NULL, 128, '1', '2022-01-15 00:35:07', '2022-01-15 00:35:07'),
(380, '2021000001796', 'شنطة نسائية أسود وبني غامق بشريط قفل جلدي', 'شنطة نسائية أسود وبني غامق بشريط قفل جلدي', '10', '15', '5', 'الحجم: الطول 20*العرض 11*الارتفاع 19*17سم', NULL, 'الأسود\\الكافي الغامق.', 'البولي فينيل كلورايد', 'Yes', 219.00, 369.00, 'B60-12/020', '<div>عنوان المنتج:&nbsp;</div><div>شنطة نسائية أسود وبني غامق بشريط قفل جلدي&nbsp;</div><div>الوصف:&nbsp;</div><div>شنطة نسائية بلون الكافي الغامق المذهل, مصممة بزخرفة عصرية منتظمة لافتة التميّز، مضاف إليها قفل جلدي مميز لإغلاق محكم، مرفق بتصميم الشنطة حزامين اختياري لليد والكتف باللون الأسود من الجلد المتين لتناسب اختلاف المناسبات والأوقات النهارية والليلية حيث تصبح سهلة الحمل، مضاف إليها لمسة اكسسوار ناعمة على القفل وقاعدة محمية بجلد أسود بنفس خامة الحزام تحميها من الخدوش، هذه الشنطة هي واحدة من التصاميم المميزة لدى شركة&nbsp; للشنط النسائية العصرية الأنيقة.</div><div>مميزات شنطة نسائية سوداء بشريط قفل جلدي:</div><div>• أحزمة ثابتة\\اختيارية.</div><div>• خفيفة الوزن.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• تتميز بقاعدة محمية الجوانب.</div><div>• ألوان راقية وكلاسيكية الأسود والكافي الغامق.</div><div>• تناغم الزخارف المنتظمة وشكل الحقيبة متناسب الأبعاد.</div><div>• بطانة داخلية متينة.</div><div>• وجود جيوب داخلية مفصلة.</div><div>• حزام الكتف من الجلد المتين باللون الأسود الأنيق.</div><div>• مقاوم للماء والغبار.</div><div>تفاصيل شنطة نسائية باللون الأسود\\الكافي الغامق:</div><div><br></div><div>اللون : الأسود\\الكافي الغامق.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001796.</div><div>الأبعاد : 20* 11* 19* 17 سم.</div><div>sku: B60-12/020</div>', 'شنطة نسائية أسود وبني غامق بشريط قفل جلدي ، تجمع بين التصميم العصري والعملي فهي مصممة بزخرفة عصرية وخامة لينة وخفيفة ولها أحزمة قابلة للتعديل', '40.65', '1', NULL, '2', 'mvcode_image_380_1793138619.jpg', 'mvcode_image_380_0_517522858.jpg|mvcode_image_380_1_113138637.jpg|mvcode_image_380_2_292585876.jpg|mvcode_image_380_3_1150331586.jpg|mvcode_image_380_4_1413501191.jpg', NULL,