(367, '2021000001666', 'شنطة ظهر أنيقة بنية بشريط ملون وجيوب خارجية', 'شنطة ظهر أنيقة بنية بشريط ملون وجيوب خارجية', '10', '15', '5', 'الحجم: الطول 27*العرض 13.5*الارتفاع 34سم', NULL, 'البني\\الكاكي.', 'البولي فينيل كلورايد', 'Yes', 219.00, 439.00, 'B53-12/020', '<div>عنوان المنتج:&nbsp;&nbsp;</div><div>شنطة ظهر أنيقة بنية بشريط ملون وجيوب خارجية&nbsp;</div><div>الوصف:&nbsp;</div><div>شنطة ظهر أنيقة للصبايا بتصميم عصري أنيق بالألوان البني والكاكي، مع شريط مثبت بألوان متناسقة في الأمام يضيف لمسة تميز للشنطة العصرية، تحتوي على جيوب خارجية اثنين على الجانبين الأيمن والأيسر وجيب أمامي محاط بإطار جلد مثبت بأزرار لامعة وسحاب جلدي بحلقات مميزة والجيب الاخر خلفي بسحاب جلدي ناعم، مضاف إلى أحزمة الكتفين الأساسيين في الشنطة حامل يد اختياري باللون الكاكي لتسهيل حمل الشنطة ولإراحة الكتفين أثناء الخروج، هذه الشنطة الراقية جدًا من تناسب فئة الصبايا حيث تخدمهم بشكل جيد أثناء الخروج في الأوقات النهارية.</div><div>مميزات شنطة ظهر أنيقة بنية وشريط ملون وجيوب خارجية:</div><div>• خفيفة الوزن.</div><div>• حزام إضافي.</div><div>• جيوب خارجية مفتوحة ومغلقة.</div><div>• أنيقة التصميم.</div><div>• خامة متينة ولينة.</div><div>• الوان راقية البني\\الكاكي.</div><div>• بطانة داخلية متينة.</div><div>• مقاوم للماء والغبار.</div><div><br></div><div>تفاصيل شنطة ظهر نسائية باللون البني والكاكي:</div><div><br></div><div>اللون : البني\\الكاكي.</div><div>الطراز : 12102</div><div>الخامات : البولي فينيل كلورايد.</div><div>كود المنتج : 2021000001666.</div><div>الأبعاد : 27* 13.5* 34 سم.</div><div>SKU: B53-12/020</div>', 'شنطة ظهر أنيقة بنية وبشريط ملون وجيوب خارجيةللحقائب ، حقيبة ظهر من متجر  أنثوية لطيفة بتصميم فريد ومواكب للموضة لإضافة لمسة فاخرة على إطلالتك', '50.11', '1', NULL, '2', 'mvcode_image_367_1585843123.jpg', 'mvcode_image_367_0_1103376168.jpg|mvcode_image_367_1_41120526.jpg|mvcode_image_367_2_1953696759.jpg|mvcode_image_367_3_2016665848.jpg|mvcode_image_367_4_1471591306.jpg', NULL, 114, '1', '2022-01-15 00:31:19', '2022-01-15 00:31:19'),
