(165, 'شنطة لابتوب وأعمال لون أسود وتصميم مميز – ماركة ساغا', NULL, '13', '18.0', '5', NULL, NULL, 'اسود', 'البوليستر', 'Yes', 66.15, 189.00, 'LSM8298-05/018', 'شنطة لابتوب وأعمال لون أسود وتصميم مميز – ماركة ساغا\r\n\r\nالوصف:\r\nشنطة لابتوب وأعمال ماركة ساغا يمكن حملها باليد أو الكتف تتميز بالأناقة والشكل الاحترافي والعملي، بلمسة عصرية فاخرة للإطلالات العملية اليومية مصنوعة من البولياستر عالي الجودة والذي يتميز بالمتانة وخفة الوزن، مخصصة لحمل وحماية الكمبيوتر المحمول حيث تحتوى على جيب مدمج وحزام تثبيت داخلي لحماية الجهاز، مريحة في الحمل بفضل حزام الكتف المرن القابل لتعديل ، حقيبة الكمبيوتر موشحة باللون البرتقالي الحيوي والمميز.\r\n\r\nمميزات شنطة لابتوب وأعمال لون أسود وتصميم مميز – ماركة ساغا:\r\n• مصنوعة من مادة البولياستر عالي الجودة.\r\n• حزام كتف قابل للإزالة والتعديل.\r\n• التصميم الأنيق والجيوب المتعددة.\r\n• سحاب الحقيبة من أجود أنواع السحابات المتينة محكمة الإغلاق.\r\n• جيوب داخلية متعددة مبطنة وواسعة للحفاظ على مستلزماتك وأجهزتك بأمان.\r\n• بطانة داخلية فاخرة مقاومة للتآكل.\r\n• متعددة الجيوب ومقسمه من الداخل. \r\n• سحاب محكم للإغلاق.\r\n• حامل علوي لليد.\r\n• جيب رئيسي واحد.\r\n• جيب خارجي بسحاب.\r\n• جيب كمبيوتر محمول مدمج وحزام تثبيت داخلي.\r\n\r\n\r\nتفاصيل شنطة لابتوب ساغا لون أسود:\r\nالعلامة التجارية للشنطة : ماركة ساغا للشنط.\r\nاللون : لون أسود.\r\nالطراز : 21107\r\nالخامات : البوليستر\r\nكود المنتج : 2018000000613\r\nSKU : LSM8298-05/018\r\n', 'شنطة لابتوب وأعمال لون أسود وتصميم مميز – ماركة ساغا ، تصميم عصري من متجر ساغا للحقائب ، تحتوى على جيب مدمج لحماية اللابتوب ، مصنوعة من البوليستر عالي الجودة', '0.65', '152', 'NULL', '2', 'IMG_20210909062414.jpg', 'IMG_202109090624141.JPG|IMG_202109090624142.JPG|IMG_202109090624143.JPG|IMG_202109090624144.JPG', '1', '2021-09-09 14:32:05', '2021-09-09 14:32:05'),
