(169, 'شنطة ظهر ماركة ساغا – لون أسود ', NULL, '11', '18.0', '5', NULL, NULL, 'اسود', 'نايلون', 'Yes', 99.60, 249.00, 'LSB8797-05/018', 'شنطة شنطة ظهر ماركة ساغا – لون أسود \r\n\r\nالوصف: \r\nشنطة ظهر ماركة ساغا فاخرة بتصميم شبابي راقي، واسعة تتسع لحمل الكمبيوتر المحمول والمستلزمات الشخصية، متعددة الاستخدامات تتميز بحجمها المثالي والمميز وتقسيمتها الداخلية المتعددة والمبطنة ببطانة مقاومة لتآكل، حمالات كتفين مريحة قابلة لتعديل ، وحشوة الظهر طبية تسمح بتهوية الظهر، مصنوعة من النايلون عالي الجودة والذي يتميز بالمتانة وخفة الوزن، حقيبة الظهر من ساغا مناسبة لجميع المشاوير العملية.\r\n\r\nمميزات شنطة ظهر ماركة ساغا – لون أسود :\r\n• التصميم الأنيق والجيوب المتعددة.\r\n• مصنوعة من مادة النايلون عالي الجودة.\r\n• حمالات كتفين مريحة قابلة لتعديل.\r\n• سحاب الحقيبة مزدوج من أجود أنواع السحابات المتينة محكمة الإغلاق.\r\n• جيوب داخلية متعددة مبطنة وواسعة للحفاظ على مستلزماتك وأجهزتك بأمان.\r\n• بطانة داخلية فاخرة مقاومة للتآكل.\r\n• حامل علوي لليد.\r\n• متعددة الجيوب والتقسيمات الخارجية.\r\n• سحاب محكم للإغلاق.\r\n• جيب كمبيوتر محمول مدمج وحزام تثبيت داخلي.\r\n\r\n\r\nتفاصيل شنطة ظهر ماركة ساغا – لون أسود :\r\nالعلامة التجارية للشنطة : ماركة ساغا للشنط.\r\nاللون : لون أسود.\r\nالطراز : 21106\r\nالخامات : نايلون\r\nكود المنتج : 2018000000618\r\n', 'شنطة ظهر ماركة ساغا – لون أسود ، حقيبة ظهر بتصميم شبابي ، متعددة الاستخدامات وتتميز بحجمها المثالي لاستيعاب الكمبيوتر المستلزمات الشخصية ، متوفرة في متجر ساغا ', '0.6', '21', 'NULL', '2', 'IMG_20210909062716.jpg', 'IMG_202109090627161.JPG|IMG_202109090627162.JPG|IMG_202109090627163.JPG|IMG_202109090627164.JPG', '1', '2021-09-09 14:33:20', '2021-09-09 14:33:20'),
(170, 'شنطة ظهر ماركة ساغا – لون رمادي وأسود', NULL, '11', '18.0', '5', NULL, NULL, 'اسود', 'البوليستر', 'Yes', 99.60, 249.00, 'LSB8374R1-05/018', 'شنطة ظهر ماركة ساغا – لون رمادي وأسود\r\nالوصف: \r\nشنطة ظهر شبابية ماركة ساغا العالمية, شنطة يحتاجها الشباب للجامعة والعمل, توفر الراحة والسعة لاحتواء جميع الأغراض اللازمة أثناء الخروج, تكتمل مميزاتها بالتصميم الخارجي الأنيق بتناغم الألوان بين الرمادي والأسود, يتضمن تصميمها الخارجي جيوب وحامل يد وحاملين للأكتاف من نفس البطانة الطبية التي تملئ الظهر؛ حيث تسمح للشعور بمتعة أكثر أثناء الاستخدام, مختومة من ماركة ساغا العالمية في الجانب الأمامي بختم معدني ثابت يضمن جودتها.\r\n\r\nمميزات شنطة ظهر ماركة ساغا – لون رمادي وأسود:\r\n• التصميم الأنيق والجيوب المتعددة.\r\n• مصنوعة من مادة البوليستر عالية الجودة.\r\n• حمالات كتفين مريحة قابلة لتعديل.\r\n• سحاب الحقيبة مزدوج من أجود أنواع السحابات المتينة محكمة الإغلاق.\r\n• جيوب داخلية متعددة مبطنة وواسعة للحفاظ على مستلزماتك وأجهزتك بأمان.\r\n• بطانة داخلية فاخرة مقاومة للتآكل.\r\n• حامل علوي لليد.\r\n• متعددة الجيوب والتقسيمات الخارجية.\r\n• سحاب محكم للإغلاق.\r\n• جيب كمبيوتر محمول مدمج وحزام تثبيت داخلي.\r\n\r\nتفاصيل شنطة ظهر ماركة ساغا – لون رمادي وأسود:\r\nالعلامة التجارية للشنطة : ماركة ساغا للشنط.\r\nاللون : لون أسود.\r\nالطراز : 11106.\r\nالخامات : البوليستر.\r\nكود المنتج : 2018000000619.\r\nsku : LSB8374R1-05/018', 'شنطة ظهر ماركة ساغا – لون رمادي وأسود ، حقيبة ظهر مصنوعة من مادة البوليستر ، متعددة الاستخدامات وتتسع للعديد من الأغراض الشخصية وبها جيب مدمج خاص بجهاز الكمبيوتر', '0.6', '15', 'NULL', '2', 'IMG_20210909062731.jpg', 'IMG_202109090627311.JPG|IMG_202109090627312.JPG|IMG_202109090627313.JPG|IMG_202109090627314.JPG', '1', '2021-09-09 14:33:20', '2021-09-09 14:33:20');
