(172, 'شنطة ظهر نسائية أنيقة باللون الأزرق – ماركة ساغا ', NULL, '11', '18.0', '5', NULL, NULL, 'ازرق', 'نايلون', 'Yes', 55.60, 139.00, 'LSB8333-1A-05/018', 'شنطة ظهر نسائية أنيقة باللون الأزرق – ماركة ساغا \r\nالوصف: \r\nشنطة ظهر زرقاء ماركة ساغا العالمية, شنطة يومية مثالية بمظهر عصري أنيق باللون الأزرق الاستثنائي, تصميمها ناعم وأنيق جدًا من الخارج ومنظم بسعة جيدة من الداخل, تصميمها الخارجي جذاب من خامة النايلون المتين مدمج به جلد أزرق داكن لإطلالة مميزة مع الأزياء الانتقائية, يتميز تصميمها بحامل اليد من الجلد المتين مع حمالات الأكتاف الطبية المريحة, كما تتضمن جيب خارجي بسيط وجيوب جانبية مفتوحة تستخدمها وقت الحاجة, هذه الشنطة الراقية تناسب الأذواق الاستثنائية.\r\n\r\nمميزات شنطة ظهر نسائية أنيقة باللون الأزرق – ماركة ساغا :\r\n• التصميم الأنيق والجيوب المتعددة.\r\n• مصنوعة من مادة النايلون عالي الجودة.\r\n• حمالات كتفين مريحة قابلة لتعديل.\r\n• سحاب الحقيبة مزدوج من أجود أنواع السحابات المتينة محكمة الإغلاق.\r\n• جيوب داخلية متعددة مبطنة وواسعة للحفاظ على مستلزماتك وأجهزتك بأمان.\r\n• بطانة داخلية فاخرة مقاومة للتآكل.\r\n• حامل علوي لليد.\r\n• متعددة الجيوب والتقسيمات الخارجية.\r\n• سحاب محكم للإغلاق.\r\n• جيب كمبيوتر محمول مدمج وحزام تثبيت داخلي.\r\n\r\nتفاصيل شنطة ظهر نسائية أنيقة باللون الأزرق – ماركة ساغا :\r\nالعلامة التجارية للشنطة : ماركة ساغا للشنط.\r\nاللون : لون أزرق.\r\nالطراز : 11106.\r\nالخامات : النايلون.\r\nكود المنتج : 2018000000621.\r\nSKU : LSB8333-1A-05/018', 'شنطة ظهر نسائية أنيقة باللون الأزرق – ماركة ساغا للحقائب ، حقيبة ظهر ذات تصميم أنثوي أنيق من النايلون المتين المدمج بالجلد الأزرق المميز ، متوفرة في متجر ساغا', '0.6', '63', 'NULL', '2', 'IMG_20210909062802.jpg', 'IMG_202109090628021.JPG|IMG_202109090628022.JPG|IMG_202109090628023.JPG|IMG_202109090628024.JPG', '1', '2021-09-09 14:33:32', '2021-09-09 14:33:32'),
(173, 'شنطة ظهر نسائية لون أورانج – ماركة ساغا ', NULL, '11', '18.0', '5', NULL, NULL, 'اورانج', 'البوليستر', 'Yes', 67.60, 169.00, 'LSB9081M-05/018', 'شنطة ظهر نسائية لون أورانج – ماركة ساغا \r\nالوصف: \r\nشنطة ظهر نسائية مميزة ماركة ساغا العالمية, تصميمها عصري مبتكر بأحزمة وجيوب إضافية توفر سعة أكثر للممتلكات والمستلزمات الخاصة أثناء الخروج, تتميز بحامل يد من أشرطة قماشية متينة وحمالات أكتاف طبية مريحة لمتعة استخدام مضاعفة, ألونها مميزة وتختلف في الجوانب والجيوب بين اللونين الأورانج والأبيض الناصع, مناسبة للاستخدام اليومي لإطالة فريدة غير اعتيادية.\r\n\r\nمميزات شنطة ظهر نسائية لون أورانج – ماركة ساغا :\r\n• التصميم الأنيق والجيوب المتعددة.\r\n• مصنوعة من مادة البوليستر عالية الجودة.\r\n• حمالات كتفين مريحة قابلة لتعديل.\r\n• سحاب الحقيبة مزدوج من أجود أنواع السحابات المتينة محكمة الإغلاق.\r\n• جيوب داخلية متعددة مبطنة وواسعة للحفاظ على مستلزماتك وأجهزتك بأمان.\r\n• بطانة داخلية فاخرة مقاومة للتآكل.\r\n• حامل علوي لليد.\r\n• متعددة الجيوب والتقسيمات الخارجية.\r\n• سحاب محكم للإغلاق.\r\n• جيب كمبيوتر محمول مدمج وحزام تثبيت داخلي.\r\n\r\nتفاصيل شنطة ظهر نسائية لون أورانج – ماركة ساغا :\r\nالعلامة التجارية للشنطة : ماركة ساغا للشنط.\r\nاللون : لون أورانج.\r\nالطراز : 11106.\r\nالخامات : البوليستر.\r\nكود المنتج : 2018000000622.\r\nSKU : LSB9081M-05/018', 'شنطة ظهر نسائية لون أورانج – ماركة ساغا ، حقيبة ذات تصميم عصري مبتكر بأحزمة وجيوب إضافية توفر سعة إضافية، وحامل يد من أشرطة قماشية متينة وحمالات أكتاف طبية مريحة', '0.6', '80', 'NULL', '2', 'IMG_20210909062818.jpg', 'IMG_202109090628181.JPG|IMG_202109090628182.JPG|IMG_202109090628183.JPG|IMG_202109090628184.JPG', '1', '2021-09-09 14:33:43', '2021-09-09 14:33:43'),
(174, 'صندوق اكسسوارات اسطواني – ماركة ساغا ', NULL, '11', '19.0', '5', NULL, NULL, 'اسود', '42', 'Yes', 99.60, 249.00, 'TJ2221-05/018', 'صندوق اكسسورات اسطواني – ماركة ساغا \r\nالوصف: \r\nشنطة اكسسوارات عصرية ماركة ساغا, شنطة تأخذ شكل اسطواني أنيق يتسع لتنظيم أكبر كمية من الاكسسوارات, فهي تأتي بتصميم عملي متعدد الأقسام يستوعب الأحجام المختلفة للاكسسوارات, مصنوعة من خامات عالية الجودة, يتضمن تصميمها حامل يد علوي مع قفل معدني مثبت على محيطها الدائري, لونها الخارجي أزرق أنيق يتناغم مع لونها الداخلي الناصع, هذه الشنطة الرائعة هي ما تحتاجيه لحماية مجوهراتك الثمينة.\r\n\r\nمميزات صندوق اكسسوارات اسطواني – ماركة ساغا :\r\n• التصميم الأنيق والأقسام المتعددة.\r\n• مصنوعة من خامات عالية الجودة.\r\n• حامل يد علوي مثبت بشكل متين.\r\n• تقسيمات داخلية متعددة وواسعة لاستيعاب أكبر كمية من المجوهرات ذات الأحجام المختلفة.\r\n• دروج قوية بمقابض صغيرة سهلة الفتح والإغلاق.\r\n• بطانة داخلية فاخرة مقاومة للتآكل.\r\n• قفل معدني لإغلاق محكم.\r\n\r\nتفاصيل صندوق اكسسوارات اسطواني – ماركة ساغا :\r\nالعلامة التجارية للشنطة : ماركة ساغا للشنط.\r\nاللون : لون أزرق.\r\nالطراز : 13104.\r\nكود المنتج : 2018000000626.\r\nSKU : TJ2221-05/018\r\n', 'صندوق اكسسوارات اسطواني – ماركة ساغا ، يقدم متجر ساغا حقيبة اكسسورات أنثوية مصنوعة من خامة عالية الجودة محاطة من الداخل ببطانة فاخرة لحماية المجوهرات من التلف', '0.6', '2', 'NULL', '2', 'IMG_20210909062835.jpg', 'IMG_202109090628351.JPG|IMG_202109090628352.JPG|IMG_202109090628353.JPG|IMG_202109090628354.JPG', '1', '2021-09-09 14:33:43', '2021-09-09 14:33:43'),
(175, 'صندوق مجوهرات راقي بسعة تنظيم كبيرة – ماركة ساغا ', NULL, '11', '19.0', '5', NULL, NULL, 'اسود', '42', 'Yes', 279.60, 699.00, 'TJ2325-05/018', 'صندوق مجوهرات راقي بسعة تنظيم كبيرة – ماركة ساغا \r\nالوصف: \r\nشنطة مجوهرات مميزة ماركة ساغا, شنطة تأخذ شكل أنيق يتسع لتنظيم أكبر كمية من المجوهرات, تأتي بتصميم عملي متعدد الأقسام يستوعب الأحجام المختلفة للمجوهرات من (خواتم, سلاسل, أقراط, أساور, ساعات, بروشات), مصنوعة من خامات عالية الجودة, يتضمن تصميمها حامل يد علوي مع قفل رقمي TSA مثبت على محيطها بإحكام, لونها الخارجي أسود أنيق يتناغم مع لونها الداخلي الناصع, هذه الشنطة الرائعة بسعتها الكبيرة وتنظيمها الدقيق هي ما تحتاجيه لترتيب وحماية مجوهراتك الثمينة.\r\n\r\nمميزات صندوق مجوهرات راقي بسعة تنظيم كبيرة – ماركة ساغا :\r\n• التصميم الأنيق والأقسام المتعددة.\r\n• مصنوع من خامات عالية الجودة.\r\n• حماية عالية بقفل رقمي TSA .\r\n• حامل يد علوي مثبت بشكل متين.\r\n• تقسيمات داخلية متعددة وواسعة لاستيعاب أكبر كمية من المجوهرات ذات الأحجام المختلفة.\r\n• دروج قوية بمقابض صغيرة سهلة الفتح والإغلاق.\r\n• بطانة داخلية فاخرة مقاومة للتآكل.\r\n• قفل معدني لإغلاق محكم.\r\n \r\nتفاصيل صندوق مجوهرات راقي بسعة تنظيم كبيرة – ماركة ساغا :\r\nالعلامة التجارية للشنطة : ماركة ساغا للشنط.\r\nاللون : لون أسود.\r\nالطراز : 13104.\r\nكود المنتج : 2018000000627.\r\nSKU: TJ2325-05/018', 'صندوق مجوهرات راقي بسعة تنظيم كبيرة – ماركة ساغا ، تأخذ شكل أنيق وتصميم عملي متعدد الأقسام لحماية المجوهرات من التلف، تأتي مع قفل رقمي  TSA، متوفرة في متجر ساغا', '0.6', '2', 'NULL', '2', 'IMG_20210909062902.jpg', 'IMG_202109090629021.JPG|IMG_202109090629022.JPG|IMG_202109090629023.JPG|IMG_202109090629024.JPG', '1', '2021-09-09 14:33:43', '2021-09-09 14:33:43'),
