(89, 'Elegant card wallet - Saga brand', 'elegant-card-wallet---saga-brand-', '3', '5', '5', 'SIZE:L19*W5*H23cm', NULL, 'BLACK', 'LEATHER', NULL, 49.50, 99.00, 'B01-11/018', 'Elegant card wallet - Saga brand for bags\r\n\r\nthe description:\r\nCard wallet with leather cover in elegant patterned from saga brand, a wallet made of luxury leather with a modern and elegant design that suits a classy man, its internal design consists of two wide pockets in addition to a side pocket to hold the largest number of important cards, booster with a push lock closed well that protects the internal pockets from falling cards, stamped with elegant Saga brand on inside on black leather, this wallet is a combination of elegance and sophistication in every elegant man\'s hand.\r\n\r\nElegant card wallet - Saga brand for bags features:\r\n? Stylish modern design.\r\n? Made of luxury pattern leather in black color.\r\n? Internal pockets with two parts (free capacity) and a side pocket.\r\n? High protection with push lock closed well.\r\n\r\nElegant card wallet - Saga brand for bags details:\r\nBag brand: Saga brand for bags.\r\nColor: black color.\r\nITEM GROUP : 15107.\r\nProduct code: 2019000000301.\r\nSKU : B01-11/018', 'Elegant card wallet - Saga brand , elegant design with an inlaid leather cover, and the internal design consists of two spacious pockets in addition to a side pocket to hold the largest number of cards, reinforced with a push lock', '6', '3', NULL, '1', 'IMG_20210909063401.jpg', 'IMG_202109090634011.JPG|IMG_202109090634012.JPG|IMG_202109090634013.JPG|IMG_202109090634014.JPG', '1', '2021-09-14 04:57:23', '2021-09-14 04:57:23'),
(90, 'Card wallet - black color , Saga brand', 'card-wallet---black-color-,-saga-brand-', '3', '5', '5', 'SIZE:L19*W5*H23cm', NULL, 'BLACK', 'LEATHER', NULL, 49.50, 99.00, 'AC01-04/019', 'Card wallet - black color , Saga brand\r\n\r\nthe description:\r\nMen\'s card wallet with a stylish leather cover saga brand , a wallet made of luxury leather with a distinctive modern design that suits a classy man, its internal design consists of a spacious pocket in addition to 9 internal pockets to contain the largest number of important cards, boosters with a push lock closed well that protects the internal pockets from falling cards With an elegant black leather color, this wallet is all you need to organize your important cards.\r\n\r\nCard wallet - black color , Saga brand features:\r\n? Stylish modern design.\r\n? Made of luxury black leather.\r\n? Internal pockets with a section (free capacity) and 9 side pockets.\r\n? High protection with  push lock closed well.\r\n\r\nCard wallet - black color , Saga brand details:\r\nBag brand: Saga brand for bags.\r\nColor: black color.\r\nITEM GROUP : 15107.\r\nProduct Code: 2019050000430\r\nsku : AC01-04/019', 'Card wallet - black color , Saga brand - men\'s wallet in luxury leather with a modern design, with a spacious pocket in addition to 9 internal pockets to contain the largest number of cards and reinforced with a push lock', '6', '7', NULL, '1', 'IMG_20210909063415.jpg', 'IMG_202109090634151.JPG|IMG_202109090634152.JPG|IMG_202109090634153.JPG|IMG_202109090634154.JPG', '1', '2021-09-14 04:57:46', '2021-09-14 04:57:46');
